TS.raw_templates['star_item'] = "{{!-- hbslint-disable syntax --}}\n{{!-- TODO: Enable syntax linter and refactor to use a safeString --}}\n{{i18n_ns 'stars'}}\n\n{{#if_equal star.type compare=\"channel\"}}\n\t{{starWithTip 'channel' star.channel null}}\n\t<strong>{{{makeChannelLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(channel){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"group\"}}\n\t{{starWithTip 'group' star.channel null}}\n\t<strong>{{{makeGroupLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(private channel){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"im\"}}\n\t{{starWithTip 'im' star.channel null}}\n\t<strong>{{{makeIMLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(direct message conversation){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"file_comment\"}}\n\t{{#if star.file.is_deleted}}\n\t{{else}}\n\t\t{{#if from_starred_item}}\n\t\t\t<div class=\"file_comment_item\">\n\t\t\t\t<div class=\"actions\">\n\t\t\t\t\t<div class=\"file_star btn_icon btn btn_outline ts_tip_btn ts_tip ts_tip_top\">\n\t\t\t\t\t\t{{starWithTip 'file_comment' star.comment star.file true}}\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t{{{comment_standalone star.comment star.file true}}}\n\t\t\t<\/div>\n\t\t{{else}}\n\t\t\t{{starWithTip 'file_comment' star.comment star.file}}\n\t\t\t{{{comment_standalone star.comment star.file}}}\n\t\t{{\/if}}\n\t{{\/if}}\n{{\/if_equal}}\n\n";
TS.raw_templates['star_with_tip'] = "{{i18n_ns 'star'}}\n\n<button type=\"button\" {{#each html_attrs}}{{@key}}=\"{{this}}\" {{\/each}} class=\"{{#each class_names}}{{this}} {{\/each}}ts_tip ts_tip_float ts_tip_hidden btn_unstyle\">\n\t<span class=\"ts_tip_tip\" data-tip-toggle-auto=\"{{#if is_starred}}{{#t}}Star this {readable_type}{{\/t}}{{else}}{{#t}}Unstar this {readable_type}{{\/t}}{{\/if}}\">\n\t\t{{#if is_starred}}{{#t}}Unstar this {readable_type}{{\/t}}{{else}}{{#t}}Star this {readable_type}{{\/t}}{{\/if}}\n\t<\/span>\n<\/button>\n";
TS.raw_templates['channel_create_dialog'] = "\t{{i18n_ns \"channel_modal\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t\t<h3>{{#t}}Rename this channel{{\/t}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t<p class=\"top_margin\">\n\t\t\t<label for=\"channel_create_title\" class=\"inline_block\">{{#t}}Name{{\/t}}<\/label>\n\t\t\t<input id=\"channel_create_title\" name=\"title_input\" type=\"text\" class=\"small title_input {{#isWeb}}no_bottom_margin{{\/isWeb}}\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" \/>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note{{\/isWeb}}\">\n\t\t\t\t{{#t}}Names should be lowercase, with no spaces.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden name_taken_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}That name has been taken. Try something different.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden invalid_chars_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}You entered some disallowed characters in the name, which we've fixed. Make sure it looks good to you, and try again!{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden single_punctuation_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}Sorry! Names cannot be a single hyphen or underscore.{{\/t}}\n\t\t\t<\/span>\n\t\t<\/p>\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t{{#if is_group}}\n\t\t\t<button type=\"button\" class=\"btn dialog_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">{{#t}}Rename Private Channel{{\/t}}<\/span><\/button>\n\t\t{{else}}\n\t\t\t<button type=\"button\" class=\"btn dialog_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">{{#t}}Rename Channel{{\/t}}<\/span><\/button>\n\t\t{{\/if}}\n\t<\/div>\n";
TS.raw_templates['purpose_dialog'] = "\t{{i18n_ns \"dialogs_purpose\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if model_ob.purpose.value}}{{#t}}Edit channel purpose{{\/t}}{{else}}{{#t}}Set channel purpose{{\/t}}{{\/if}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t<p>\n\t\t\t<label for=\"purpose_input\" class=\"inline_block\" style=\"min-width: 6rem; padding-right: 1rem;\">\n\t\t\t\t{{#t name=\"Refers to channel purpose\"}}Purpose{{\/t}}<br \/>\n\t\t\t\t<span class=\"normal\">{{#t}}(optional){{\/t}}<\/span>\n\t\t\t<\/label>\n\t\t\t<textarea id=\"purpose_input\" name=\"purpose_input\" type=\"text\" style=\"height: 4.5rem;\" maxlength=\"{{ChannelPurposeMaxLength}}\" tabindex=\"1\">{{unFormatMessage model_ob.purpose.value}}<\/textarea>\n\t\t\t<span class=\"modal_input_note\" style=\"margin-left: 100px;\">\n\t\t\t\t{{#t}}Give your channel a purpose that describes what it will be used for.{{\/t}}\n\t\t\t\t{{#if model_ob.purpose.creator}}\n\t\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\t\t<br \/>\n\t\t\t\t\t\t{{#t creator=(makeMemberPreviewLinkById model_ob.purpose.creator) date=(toCalendarDate model_ob.purpose.last_set)}}The purpose was last set by {creator} on {date}.{{\/t}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/span>\n\t\t<\/p>\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go\" tabindex=\"2\">{{#t note=\"Update channel purpose\"}}Update Purpose{{\/t}}<\/button>\n\t<\/div>\n";
TS.raw_templates['channel_prefs_dialog'] = "{{i18n_ns 'dialogs'}}\n\n<div class=\"modal-header\">\n\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t<h3>{{#t}}Notification Preferences: {display_name}{{\/t}}<\/h3>\n<\/div>\n<div class=\"modal-body feature_muting\">\n\n\t<div id=\"notifications_not_working\" class=\"hidden\">\n\t\t<p class=\"bold small_bottom_margin\"><i class=\"ts_icon ts_icon_laptop ts_icon_inherit small_right_margin\" style=\"margin-left: 0.4rem; width: 1rem\"><\/i> {{#t}}Desktop notifications{{\/t}}<\/p>\n\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t<span id=\"notifications_not_yet_allowed\" class=\"hidden\">{{#t}}You have not yet allowed desktop notifications. Open the <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> and follow the instructions to set them up.{{\/t}}<\/span>\n\t\t\t<span id=\"notifications_not_enabled\" class=\"hidden\">{{#t}}You\u2018ve disabled desktop notifications. Open the <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> to change that.{{\/t}}<\/span>\n\t\t\t<span id=\"notifications_not_allowed\" class=\"hidden\">{{#t}}You\u2018ve disallowed notifications in your browser. You\u2018ll need to open your browser preferences to change that.{{\/t}}<\/span>\n\t\t\t<span id=\"notifications_impossible\" class=\"hidden\">{{#t}}Your browser does not support desktop notifications. <a href=\"\/downloads\" target=\"_blank\">Try one of our apps?<\/a>{{\/t}}<\/span>\n\t\t<\/p>\n\t<\/div>\n\n\t<div id=\"non_muting_prefs\" {{#if is_muted}}style=\"display: none;\"{{\/if}}>\n\n\t\t<div id=\"notifications_working\" class=\"hidden\">\n\t\t\t<p class=\"bold small_bottom_margin\"><i class=\"ts_icon ts_icon_laptop ts_icon_inherit small_right_margin\" style=\"margin-left: 0.4rem; width: 1rem\"><\/i> {{#t}}Desktop notifications{{\/t}}<\/p>\n\t\t\t<p class=\"small_left_margin\">\n\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t<input name=\"channel_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"everything\" \/> {{#t}}Activity of any kind <span id=\"all_everything_default\" class=\"bold\">(default)<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t<input name=\"channel_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"mentions\" \/> {{#t}}Mentions of my name or highlight words <span id=\"all_mentions_default\" class=\"bold\">(default)<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\n\t\t\t\t{{#if show_two_suppressed_cbs}}\n\t\t\t\t\t<span id=\"suppressed_span\" class=\"large_left_margin inline_block\">\n\t\t\t\t\t<label class=\"checkbox no_margin\" id=\"suppressed_label\">\n\t\t\t\t\t\t<input id=\"suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/> {{#t at_channel=(atLabel 'channel')}}Except for {at_channel} mentions <span id=\"suppressed_disabled_explain\" class=\"normal mini subtle_silver\">(disabled due to <strong id=\"suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">team settings<\/strong>)<\/span>{{\/t}}\n\t\t\t\t\t<\/label>\n\t\t\t\t\t<\/span>\n\t\t\t\t{{\/if}}\n\n\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t<input name=\"channel_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"nothing\" \/> {{#t}}Nothing <span id=\"all_nothing_default\" class=\"bold\">(default)<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<p class=\"bold small_bottom_margin\"><i class=\"ts_icon ts_icon_mobile ts_icon_inherit\" style=\"font-size: 19px; width: 1rem; margin-left: 0.3rem; margin-right: 0.3rem;\"><\/i> {{#t}}Mobile push notifications{{\/t}}<\/p>\n\t\t<p class=\"small_left_margin\">\n\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t<input name=\"channel_push_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"everything\" \/> {{#t}}Activity of any kind <span id=\"all_push_everything_default\" class=\"bold\">(default)<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t<input name=\"channel_push_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"mentions\" \/> {{#t}}Mentions of my name or highlight words <span id=\"all_push_mentions_default\" class=\"bold\">(default)<\/span>{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t{{#if show_two_suppressed_cbs}}\n\t\t\t\t<span id=\"push_suppressed_span\" class=\"large_left_margin inline_block\">\n\t\t\t\t<label class=\"checkbox no_margin\" id=\"push_suppressed_label\">\n\t\t\t\t\t<input id=\"push_suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/> {{#t at_channel=(atLabel 'channel')}}Except for {at_channel} mentions <span id=\"push_suppressed_disabled_explain\" class=\"normal mini subtle_silver\">(disabled due to <strong id=\"push_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">team settings<\/strong>)<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t\t<\/span>\n\t\t\t{{\/if}}\n\n\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t<input name=\"channel_push_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"nothing\" \/> {{#t}}Nothing <span id=\"all_push_nothing_default\" class=\"bold\">(default)<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t<\/p>\n\n\t\t{{#if show_one_suppressed_cb}}\n\t\t\t<div id=\"single_suppressed_div\">\n\t\t\t\t<p class=\"bold no_bottom_margin\" style=\"margin-left: 0.45rem;\">\n\t\t\t\t\t{{#if model_ob.is_general}}\n                        {{#t at_label='@everyone'}}{at_label} notifications{{\/t}}\n                    {{else}}\n                        {{#t at_label='@channel'}}{at_label} notifications{{\/t}}\n                    {{\/if}}\n\t\t\t\t<\/p>\n\t\t\t\t<p class=\"small_left_margin\">\n\t\t\t\t\t<label class=\"checkbox no_margin normal\" id=\"single_suppressed_label\">\n\t\t\t\t\t\t<input id=\"single_suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/>\n                        {{#if model_ob.is_general}}\n                            {{#t at_label=(atLabel 'everyone') at_here=(atLabel 'here')}}Mute notifications for <strong>{at_label}<\/strong> and <strong>{at_here}<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(on mobile)<\/span><span id=\"single_suppressed_desktop_qualifier\">(on desktop)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Disabled by <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">admin<\/strong><\/span>{{\/t}}\n                        {{else}}\n                            {{#t at_label=(atLabel 'channel') at_here=(atLabel 'here')}}Mute notifications for <strong>{at_label}<\/strong> and <strong>{at_here}<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(on mobile)<\/span><span id=\"single_suppressed_desktop_qualifier\">(on desktop)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Disabled by <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">admin<\/strong><\/span>{{\/t}}\n                        {{\/if}}\n\t\t\t\t\t<\/label>\n\t\t\t\t<\/p>\n\t\t\t<\/div>\n\t\t{{\/if}}\n\n\t<\/div>\n\n\t<div id=\"muting_div\">\n\t\t<p class=\"bold no_bottom_margin\">\n\t\t\t<label class=\"checkbox no_margin no_left_padding\" id=\"muting_label\">\n\t\t\t\t<i class=\"ts_icon ts_icon_bell_slash ts_icon_inherit small_right_margin\" style=\"font-size: 18px; margin-left: 0.5rem; width: 1rem\"><\/i>\n                {{#if is_mpim}}\n                    {{#t}}Mute this conversation{{\/t}}\n                {{else}}\n                    {{#if_equal c_or_g compare=\"channel\"}}\n                        {{#t}}Mute this channel{{\/t}}\n                    {{else}}\n                        {{#t}}Mute this private channel{{\/t}}\n                    {{\/if_equal}}\n                {{\/if}}\n\t\t\t\t<input id=\"muting_cb\" checked=\"checked\" type=\"checkbox\" style=\"float: none; margin: -1px 0 0 0.5rem !important; vertical-align: middle;\" \/>\n\t\t\t<\/label>\n\t\t<\/p>\n\t\t<p class=\"small_left_margin no_bottom_margin\">\n            {{#if is_mpim}}\n                {{#t}}Muting prevents all notifications from this conversation and prevents the conversation from appearing as unread unless you are mentioned.{{\/t}}\n            {{else}}\n                {{#if_equal c_or_g compare=\"channel\"}}\n                    {{#t}}Muting prevents all notifications from this channel and prevents the channel from appearing as unread unless you are mentioned.{{\/t}}\n                {{else}}\n                    {{#t}}Muting prevents all notifications from this private channel and prevents the channel from appearing as unread unless you are mentioned.{{\/t}}\n                {{\/if_equal}}\n            {{\/if}}\n\t\t<\/p>\n\t<\/div>\n\n<\/div>\n<div class=\"modal-footer\">\n\t<p class=\"mini float_left small_top_margin no_bottom_margin\">{{#t}}Set your default notifications settings in your <a href=\"\/account\/notifications\" target=\"_blank\" class=\"bold\">Account Preferences<\/a>{{\/t}}<\/p>\n\t<a class=\"btn dialog_go\">{{#t}}Done{{\/t}}<\/a>\n<\/div>\n";
TS.raw_templates['file_upload_dialog'] = "{{i18n_ns \"upload\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#t note=\"Dialog title\" }}Upload a file? <span class=\"file_count\"><\/span>{{\/t}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\n\t\t{{#if over_storage_limit}}\n\t\t\t<p class=\"alert alert_warning\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t{{#t note=\"Inline error message indicating the team's storage limit has been exceeded.\"}}Your team is over its storage limit.<br \/> Please <a href=\"\/pricing\" target=\"{newWindowName}\" class=\"bold underline\">upgrade to a paid plan<\/a> or <a href=\"\/files\" target=\"{newWindowName}\" class=\"bold underline\">delete the files you don\u2019t need<\/a>.{{\/t}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\n\t\t<div id=\"upload_image_preview\" class=\"hidden bottom_margin\">\n\t\t\t<img src=\"\" alt=\"{{#t note=\"Text description of the image preview for the file for users who are visually impaired\"}}Preview of {filename}{{\/t}}\" \/>\n\t\t<\/div>\n\n\t\t<p>\n\t\t\t<label for=\"upload_file_title\" class=\"inline_block\">{{#t note=\"Label for the title used to describe the file\"}}Title{{\/t}}<\/label>\n\t\t\t<input id=\"upload_file_title\" name=\"upload_file_title\" type=\"text\" class=\"small title_input\" value=\"{{title}}\" aria-describedby=\"upload_file_title_instructions\" \/>\n\t\t\t<span id=\"upload_file_title_instructions\" class=\"modal_input_note\">\n\t\t\t\t{{#t}}Titles are the easiest ways to search for files: it pays to be descriptive.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<input id=\"upload_file_name\" name=\"upload_file_name\" type=\"hidden\" {{#if has_name}}disabled=\"disabled\"{{else}}{{\/if}} class=\"filename_input\" value=\"{{filename}}\" \/>\n\t\t<\/p>\n\n\t\t{{{sharing_html}}}\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<div class=\"upload_actions\">\n\t\t\t{{#if file_retention_type}}\n\t\t\t\t<div class=\"modal_input_note_full_width float_left inline_block align_left\">\n\t\t\t\t\t{{#t}}Due to your team\u2019s custom file retention <br \/>policy, this file will be deleted after <span class=\"bold\">{file_retention_duration}<\/span>.{{\/t}}\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t\t{{#if more_in_queue}}<button type=\"button\" class=\"btn btn_outline dialog_cancel_all\">{{#t note=\"Label for the button that cancels uploading all files when multiple files have been selected for upload.\"}}Cancel All{{\/t}}<\/button>{{\/if}}\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\">{{#t note=\"Label for the cancel button that cancels uploading of the file and closes the dialog\"}}Cancel{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn dialog_go\">{{#t note=\"Label for the button that confirms the file should be uploaded\"}}Upload{{\/t}}<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">{{#t note=\"Inline confirmation message displayed if the dialog is dismissed\"}}Closing the window will discard your comment.{{\/t}}<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_go\">{{#t note=\"Label for the cancel button accompanying the inline confirmation message. Cancels the request to close the dialog.\"}}Cancel{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">{{#t note=\"Label for a button accompanying the inline confirmation message. Closes the dialog without saving changes.\"}}Close Window{{\/t}}<\/button>\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['gdrive_create_dialog'] = "{{i18n_ns 'google_drive'}}\n\n<p>\n\t<label for=\"document_title\" class=\"inline_block\">{{#t}}Title{{\/t}}<\/label>\n\t<input id=\"document_title\" name=\"document_title\" type=\"text\" class=\"small title_input\" value=\"\" tabindex=\"1\" maxlength=\"255\" \/>\n\t<span class=\"modal_input_note\">\n\t\t{{#t}}Titles are the easiest ways to search for files: it pays to be descriptive.{{\/t}}\n\t<\/span>\n<\/p>\n\n{{sharing_html}}";
TS.raw_templates['share_dialog'] = "\t{{i18n_ns \"share_dialog\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>\n\t\t\t{{#if_equal type compare='file'}}{{#t}}Share file{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_snippet'}}{{#t}}Share snippet{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_post'}}{{#t}}Share post{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_space'}}{{#t}}Share post{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_multnomah'}}{{#t}}Share multnomah{{\/t}}{{\/if_equal}}\n\t\t<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<input type=\"hidden\" id=\"share_type\" value=\"{{type}}\" \/>\n\t\t<input type=\"hidden\" id=\"share_item_id\" value=\"{{item.id}}\" \/>\n\n\t\t{{file_html}}\n\n\t\t{{sharing_html}}\n\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go\" tabindex=\"2\">{{#t}}Share{{\/t}}<\/button>\n\t<\/div>\n";
TS.raw_templates['snippet_dialog'] = "\t{{i18n_ns \"snippet\"}}\n\n\t{{!-- hbslint-disable syntax --}}\n\t{{!-- Todo: enable syntax linter and enable safeString --}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if is_edit}}{{#t}}Edit snippet{{\/t}}{{else}}{{#t}}Create snippet{{\/t}}{{\/if}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<form action=\"\" id=\"client_file_snippet\" method=\"post\" accept-encoding=\"UTF-8\" onsubmit=\"return false;\" class=\"no_bottom_margin\">\n\n\t\t\t<div class=\"top_margin\">\n\t\t\t\t<label id=\"client_file_snippet_select_label\" class=\"select small float_right no_right_padding\">\n\t\t\t\t\t<select name=\"filetype\" id=\"client_file_snippet_select\" name=\"client_file_snippet_select\" class=\"small no_top_margin\">\n\t\t\t\t\t\t<option value=\"auto\">{{#t}}Auto Detect Type{{\/t}}<\/option>\n\t\t\t\t\t\t{{#each codemirror_types}}\n\t\t\t\t\t\t\t<option value=\"{{this.type}}\">{{this.label}}<\/option>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t\t<input type=\"text\" id=\"client_file_snippet_title_input\" class=\"small\" name=\"client_file_snippet_title_input\" value=\"\" placeholder=\"{{#t}}Title (optional){{\/t}}\" \/>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"top_margin bottom_margin\">\n\t\t\t\t<textarea name=\"content\" wrap=\"virtual\" id=\"client_file_snippet_textarea\" class=\"client_file_snippet_textarea full_width{{#unless is_edit}} create_snippet{{\/unless}}\"><\/textarea>\n\t\t\t\t<label class=\"checkbox normal mini float_right no_min_width\" style=\"margin-top: 3px; padding-right: 0; width: auto;\">\n\t\t\t\t\t<input type=\"checkbox\" id=\"client_file_wrap_cb\" {{#if wrap_lines}}checked{{\/if}}> {{#t note=\"Refers to line wraps \/ breaks when writing code in a snippet\"}}wrap{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t<\/div>\n\n\t\t\t{{{sharing_html}}}\n\n\t\t<\/form>\n\n\t<\/div>\n\n\t<div class=\"modal-footer\">\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">\n\t\t\t\t{{#if is_edit}}\n\t\t\t\t\t{{#t}}Are you sure you want to discard your changes?{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Are you sure you want to discard this snippet permanently?{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel_decline\">{{#t}}No, keep it{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">\n\t\t\t\t{{#if is_edit}}\n\t\t\t\t\t{{#t}}Yes, discard the changes{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Yes, discard this snippet{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-action\">\n\t\t\t<a class=\"btn btn_outline cancel\" data-dismiss=\"modal\" tabindex=\"3\">{{#t}}Cancel{{\/t}}<\/a>\n\t\t\t{{#if is_edit}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top ts_tip_hide\" tabindex=\"2\">\n\t\t\t\t{{#t}}Save changes\n\t\t\t\t<span class=\"ts_tip_tip\">Add text before saving your changes<\/span>{{\/t}}\n\t\t\t<\/a>\n\t\t\t{{\/if}}\n\t\t\t{{#unless is_edit}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top\" tabindex=\"2\">\n\t\t\t\t{{#t}}Create Snippet\n\t\t\t\t<span class=\"ts_tip_tip\">Add text before saving your snippet<\/span>{{\/t}}\n\t\t\t<\/a>\n\t\t\t{{\/unless}}\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['growl_prompt_overlay'] = "\t{{i18n_ns \"notifications\"}}\n\n\t<div id=\"growl_prompt_overlay\">\n\n\t\t<div id=\"growl_prompt_overlay_impossible\" class=\"hidden\">\n\t\t\t<h3>{{#t}}The browser you're using doesn't support desktop notifications.{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}When someone mentions you or sends you a direct message in Slack, we can let you know via a desktop notification.{{\/t}}<\/p>\n\t\t\t<p>{{#t new_win_name=(newWindowName)}}If you'd like to get desktop notifications from Slack, you can use a browser that supports them (like <a href=\"http:\/\/www.google.com\/chrome\/\" class=\"bold\">Google Chrome<\/a>), or download one of our <a href=\"\/downloads\" class=\"bold\" target=\"{new_win_name}\">desktop apps<\/a>.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"large_top_margin no_bottom_margin\">\n\t\t\t\t<a href=\"\/downloads\" class=\"btn btn_small  see-apps\" target=\"{{newWindowName}}\">{{#t note=\"Invites user to see our desktop app offerings, or dismiss the overlay with 'Not for me'\"}}See our Apps<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">Not for me{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_start\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Turn on desktop notifications?{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}When someone mentions you or sends you a direct message in Slack, we will let you know via a desktop notification.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_allow btn btn_small \">{{#t}}Yes, turn on notifications<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">No, don't turn them on{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_tell_to_allow\" class=\"hidden\">\n\t\t\t<i class=\"ts_icon ts_icon_arrow_circle_up block float_right\" style=\"font-size: 3.5rem; margin: 0 1rem 0 0;\"><\/i>\n\t\t\t<h3>{{#t}}Turn on desktop notifications?{{\/t}}<\/h3>\n\t\t\t<p class=\"no_bottom_margin\">{{#t}}Click <strong>Allow<\/strong> above to turn on desktop notifications.{{\/t}}<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_success\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Desktop notifications enabled{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}When someone mentions you or sends you a direct message in Slack, we will let you know via a desktop notification.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_test btn btn_small \">{{#t}}Send me a test notification<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel\">I'm done{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_disallowed\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Desktop notifications disabled{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}You chose not to allow desktop notifications. You will need to update your browser preferences in order to turn them on.{{\/t}}<\/p>\n\t\t\t<p><a class=\"prompt_cancel btn btn_small float_right\">{{#t}}OK{{\/t}}<\/a><\/p>\n\t\t\t<div class=\"clear_both\"><\/div>\n\t\t<\/div>\n\n\t<\/div>\n";
TS.raw_templates['channel_invite_list'] = "{{i18n_ns 'channel_invite'}}\n\n<p class=\"top_margin no_bottom_margin\">\n    <label for=\"select_invite_channels\" class=\"inline_block lazy_filter_select\">{{#t}}Invite to{{\/t}}<\/label>\n    <select id=\"select_invite_channels\" name=\"select_invite_channels\" class=\"file_share_select no_margin\">\n        <option value=\"ts_null_value\">{{#t}}Select a channel{{\/t}}<\/option>\n        {{#each channels}}\n            <option value=\"{{this.id}}\">#{{this.name}}<\/option>\n        {{\/each}}\n    <\/select>\n<\/p>\n\n";
TS.raw_templates['group_member_invite_list'] = "\t{{i18n_ns \"invite\"}}\n\n\t<div id=\"group_invite_member_chooser\" class=\"hidden\">\n\t\t{{#if show_ra_tip}}\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t{{#t}}Type or select the names of team members that you would like to invite:{{\/t}}\n\t\t\t<\/p>\n\t\t\t<p class=\"small_bottom_margin mini subtle_silver\">\n\t\t\t\t{{#t}}Multi-channel guests may not appear below. Ask a Team Administrator to invite them.{{\/t}}\n\t\t\t<\/p>\n\t\t{{else}}\n\t\t\t<p class=\"small_bottom_margin\">\n\t\t\t\t{{#t}}Type or select the names of team members that you would like to invite:{{\/t}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\n\t\t<div id=\"select_invite_group_members_holder\">\n\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t<select multiple=\"multiple\" id=\"select_invite_group_members\" size=\"30\">\n\t\t\t\t\t{{#each invite_members}}\n\t\t\t\t\t\t<option value=\"{{this.member.id}}\" data-additional-search-field=\"@{{this.member.name}}\"{{#if this.preselected}} selected=\"selected\"{{\/if}}>{{#if this.member.profile.real_name}}{{this.member.profile.real_name}} \u2022 {{this.member.name}}{{else}}{{this.member.name}}{{\/if}}{{#if this.member.is_restricted}} {{#t}}(Multi-Channel Guest){{\/t}}{{\/if}}<\/option>\n\t\t\t\t\t{{\/each}}\n\t\t\t\t<\/select>\n\t\t\t<\/p>\n\n\t\t<\/div>\n\n\t\t<p class=\"top_margin\">\n\t\t\t<label class=\"checkbox no_margin\">\n\t\t\t\t<input id=\"archive_access_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/> {{#t}}Invited members will have access to the private channel archives{{\/t}}\n\t\t\t<\/label>\n\t\t<\/p>\n\t<\/div>\n\n\n\t<div id=\"group_invite_archives_prompt\" class=\"\">\n\t\t<p class=\"bold\">{{#t}}Should new members be allowed to see the private channel's message history?<\/p>\n\n\t\t<p>If <strong>Yes<\/strong>, new members will be invited and will have access to this private channel's entire message history.<\/p>\n\t\t<p>If <strong>No<\/strong>, this private channel will be renamed and archived. A new private channel will be created with all current members plus the new ones you invite. You and other current members will see a link back to the original private channel's archives.{{\/t}}<\/p>\n\t<\/div>\n\n";
TS.raw_templates['channel_conversion_dialog'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}Converting <strong>#{name}<\/strong> to a private channel will preserve the history and membership.{{\/t}}<\/p>\n<p class=\"small_bottom_margin\"><strong>{{#t}}Two things you should know:{{\/t}}<\/strong><\/p>\n<ul>\n\t<li>{{#t}}This conversion is not reversible. It is a one-way street.{{\/t}}<\/li>\n\t<li>{{#t}}Files that were previously shared in this channel will not become private. They will remain publicly accessible to others on your team.{{\/t}}<\/li>\n<\/ul>\n<p>{{#t}}Are you sure you want to convert <strong>#{name}<\/strong> to a private channel?{{\/t}}<\/p>\n";
TS.raw_templates['channel_data_retention_dialog'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}This message retention policy will only affect this {model_type}. Retention policies can also be set on a team-wide basis in your <a target=\"new\" href=\"\/admin\/settings#data_retention\">team settings<\/a>.{{\/t}}<\/p>\n\n<p id=\"retention_duration_warning\" class=\"alert alert_warning hidden {{#isWeb}}small{{\/isWeb}}\">\n\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t<strong>{{#t}}An important note about message retention policies{{\/t}}<\/strong><br \/>\n\t{{#t}}Setting a custom duration for message retention means that messages in this {model_type} will be  deleted after the number of days you set. This deletion is permanent and the messages will be irretrievable. Proceed with caution!{{\/t}}\n<\/p>\n\n<div class=\"clearfix\">\n\t{{#isWeb}}\n\t\t<p class=\"col span_4_of_6\">\n\t\t\t<label for=\"retention_type\" class=\"select small\">\n\t\t\t\t{{#t}}Retention Type{{\/t}}\n\t\t\t\t<select name=\"retention_type\" class=\"small\">\n\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>{{#t}}Use team preference{{\/t}}<\/option>\n\t\t\t\t\t<option value=\"1\"{{#if_equal retention_type compare=1}} selected=\"selected\"{{\/if_equal}}>{{#t}}Retain all messages for a specific number of days{{\/t}}<\/option>\n\t\t\t\t<\/select>\n\t\t\t<\/label>\n\t\t<\/p>\n\t\t<p class=\"col span_2_of_6 {{#if_equal retention_type compare=0}}hidden{{\/if_equal}}\" id=\"retention_duration_container\">\n\t\t\t<label for=\"retention_duration\">{{#t}}Duration{{\/t}}<\/label>\n\t\t\t<input type=\"text\" name=\"retention_duration\" id=\"retention_duration\" class=\"mini align_right\" value=\"{{retention_duration}}\" \/> {{#t}}days{{\/t}}\n\t\t<\/p>\n\t{{else}}\n\t\t<p class=\"col span_4_of_6\">\n\t\t\t<label for=\"retention_type\" class=\"select small full_width align_left\">\n\t\t\t\t{{#t}}Retention Type{{\/t}}\n\t\t\t\t<select name=\"retention_type\" class=\"small\" style=\"margin-bottom: 4px;\">\n\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>{{#t}}Use team preference{{\/t}}<\/option>\n\t\t\t\t\t<option value=\"1\"{{#if_equal retention_type compare=1}} selected=\"selected\"{{\/if_equal}}>{{#t}}Retain all messages for a specific number of days{{\/t}}<\/option>\n\t\t\t\t<\/select>\n\t\t\t<\/label>\n\t\t<\/p>\n\n\t\t<div class=\"col span_2_of_6 {{#if_equal retention_type compare=0}}hidden{{\/if_equal}}\" id=\"retention_duration_container\">\n\t\t\t<label for=\"retention_duration\" class=\"align_left\">{{#t}}Duration{{\/t}}<\/label>\n\t\t\t<div class=\"input-append no_bottom_margin\">\n\t\t\t\t<input type=\"text\" name=\"retention_duration\" id=\"retention_duration\" class=\"input-mini align_right\" value=\"{{retention_duration}}\" style=\"border-radius: 4px 0 0 4px !important; width: 60px; height: 37px;\" \/>\n\t\t\t\t<span class=\"add-on\" style=\"line-height: 27px;\">{{#t}}days{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/isWeb}}\n<\/div>\n\n<div id=\"team_retention_pref\" class=\"hidden\">\n\t<p>\n\t\t{{#if_equal team_type compare=0}}{{#t}}The team preference is to <strong>retain all messages.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t{{#if_equal team_type compare=1}}{{#t}}The team preference is to <strong>retain all messages AND also retain edit and deletion logs for all messages.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t{{#if_equal team_type compare=2}}{{#t}}The team preference is to <strong>retain all messages for {team_duration, plural, =1 {# day} other {# days}}.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t{{#if_equal team_type compare=3}}{{#t}}The team preference is to <strong>retain all messages for {team_duration, plural, =1 {# day} other {# days}} but keep logs for compliance exports.<\/strong>{{\/t}}{{\/if_equal}}\n\t<\/p>\n<\/div>\n\n<div class=\"alert alert_warning hidden invalid_duration_error\">\n\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t{{#t}}You must set a number of days greater than zero for message retention.{{\/t}}\n<\/div>\n";
TS.raw_templates['channel_deletion_dialog'] = "{{i18n_ns 'web_channel'}}\n\n<p>{{#t}}Are you sure you want to delete <strong>{name}<\/strong>? All its content will be removed from your Slack archives, and you cannot restore the content once deleted.{{\/t}}<\/p>\n<p class=\"large_left_margin no_bottom_margin\">\n    <label class=\"checkbox normal\" style=\"font-size: 1rem;\">\n        <input id=\"delete_channel_cb\" type=\"checkbox\" class=\"small_right_margin\" \/>\n        {{#t}}Yes, I am absolutely sure{{\/t}}\n    <\/label>\n<\/p>\n";
TS.raw_templates['channel_options_dialog'] = "{{i18n_ns 'channel_options'}}\n\n<div class=\"channel_options_section\" data-section=\"options\">\n\n\t<div class=\"channel_options_header charcoal_grey larger_bottom_padding\">\n\t\t{{#if_equal c_or_g compare=\"channel\"}}\n\t\t\t{{#t}}Additional Options for <strong>#{model_ob.name}<\/strong>{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Additional Options for <strong><ts-icon class=\"ts_icon_inherit ts_icon_lock\"><\/ts-icon>{model_ob.name}<\/strong>{{\/t}}\n\t\t{{\/if_equal}}\n\t\t{{#if model_ob.is_shared}}<ts-icon class=\"ts_icon_org_shared_channel\"><\/ts-icon>{{\/if}}\n\t<\/div>\n\n\t{{#if show_archive_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"{{#if_equal c_or_g compare='channel'}}channel_archive_btn{{else}}group_archive_btn{{\/if_equal}}\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#t}}Archive this channel{{\/t}}<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{#t}}If you don\u2019t think it will be used any more and you want to clean up, archive it. The channel can be unarchived later (but everyone will have been removed).{{\/t}}<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_convert_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"channel_convert_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#t}}Convert this channel to a private channel{{\/t}}<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{#t}}Private channels are similar to channels, but they\u2019re hidden to non-members and the conversation is private. This conversion cannot be undone.{{\/t}}<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_convert_to_shared_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"shared_channel_convert_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#t}}Convert this channel to a shared channel{{\/t}}<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{#t}}Shared channels are similar to channels, but they\u2019re shared across teams.{{\/t}}<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_rename_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"channel_rename_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#t}}Rename this channel{{\/t}}<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{#t}}You can rename a channel at any time. But, use it sparingly: it might confuse or disorient your colleagues!{{\/t}}<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_purpose_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"channel_purpose_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">\n\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\t{{#t}}Edit the channel purpose{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Set the channel purpose{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">\n\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\t{{#t formatted_purpose=(formatTopicOrPurpose model_ob.purpose.value)}}Channel purposes are especially useful to new team members choosing which conversations to join. This channel\u2019s current purpose is <em>\"{formatted_purpose}\"<\/em>{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Channel purposes are especially useful to new team members choosing which conversations to join.{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_manage_posting_privilege_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"posting_privilege_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#t}}Manage posting privileges{{\/t}}<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{#t}}Change who is allowed to post messages in this channel, and whether @here and @channel are allowed.{{\/t}}<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_data_retention_link}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"data_retention_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#t}}Set the channel message retention policy{{\/t}}<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">{{#t}}By default, Slack will save your message data for the lifetime of the team. You can configure a custom message retention policy duration.{{\/t}}<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n<\/div>\n\n<div class=\"channel_options_section\" data-section=\"option\">\n\t<div class=\"channel_options_header charcoal_grey larger_bottom_padding larger_bottom_margin\"><\/div>\n\t<div class=\"channel_option_content\"><\/div>\n\n\t<div class=\"channel_option_buttons large_top_margin\">\n\t\t<button class=\"btn btn_outline option_cancel\" data-qa=\"channel_option_cancel\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t<button class=\"btn ladda-button option_go very_small_left_margin\" data-style=\"expand-right\" data-qa=\"channel_option_go\"><span class=\"ladda-label\">{{#t}}Ok{{\/t}}<\/span><\/button>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_option_archive_channel'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}Archiving a channel is useful to clean things up when you do not anticipate using the channel any more. If you archive this channel:{{\/t}}<\/p>\n<ul>\n\t<li>{{#t}}No one will be able to send messages to it anymore{{\/t}}<\/li>\n\t<li>{{#t}}It will be closed for anyone who has it open and all members will be removed{{\/t}}<\/li>\n\t<li>{{#t}}You will be able to view past conversations in the Archives on the site{{\/t}}<\/li>\n\t<li>{{#t}}You will be able to search for archived messages from this channel{{\/t}}<\/li>\n\t<li>{{#t}}You will always be able to un-archive it later{{\/t}}<\/li>\n<\/ul>\n{{#if is_shared}}\n\t<p>{{#t}}Are you sure you want to archive <strong>#{name} <ts-icon class=\"ts_icon_shared_channel\"><\/ts-icon><\/strong>?{{\/t}}<\/p>\n{{else}}\n\t<p>{{#t}}Are you sure you want to archive <strong>#{name}<\/strong>?{{\/t}}<\/p>\n{{\/if}}\n";
TS.raw_templates['channel_option_archive_group'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}If you archive this channel, no one will be able to send any messages in it and it will be closed for anyone who currently has it open. You will still be able to view the archives on the site and you will still be able to search for messages from this channel.{{\/t}}<\/p>\n{{#if is_shared}}\n\t<p>{{#t}}Are you sure you want to archive <strong>{group_prefix}{name} <ts-icon class=\"ts_icon_shared_channel\"><\/ts-icon><\/strong>?{{\/t}}<\/p>\n{{else}}\n\t<p>{{#t}}Are you sure you want to archive <strong>{group_prefix}{name}<\/strong>?{{\/t}}<\/p>\n{{\/if}}\n";
TS.raw_templates['channel_option_rename_channel'] = "{{i18n_ns 'channel_options'}}\n\n<p class=\"top_margin\">\n\t<label for=\"channel_create_title\" class=\"\">{{#t}}Name{{\/t}}<\/label>\n\t<input id=\"channel_create_title\" name=\"title_input\" type=\"text\" class=\"small title_input {{#isWeb}}no_bottom_margin{{\/isWeb}}\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" \/>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note{{\/isWeb}}\">\n\t\t{{#t}}Names should be lowercase, with no spaces.{{\/t}}\n\t<\/span>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden name_taken_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}That name has been taken. Try something different.{{\/t}}\n\t<\/span>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden invalid_chars_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}You entered some disallowed characters in the name, which we\u2019ve fixed. Make sure it looks good to you, and try again!{{\/t}}\n\t<\/span>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden single_punctuation_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}Sorry! Names cannot be a single hyphen or underscore.{{\/t}}\n\t<\/span>\n<\/p>\n";
TS.raw_templates['channel_option_purpose'] = "{{i18n_ns 'channel_options'}}\n\n<p>\n\t<label for=\"purpose_input\" class=\"inline_block right_padding\">\n\t\t{{#t}}Purpose <span class=\"normal\">(optional)<\/span>{{\/t}}\n\t<\/label>\n\t<textarea id=\"purpose_input\" name=\"purpose_input\" type=\"text\" maxlength=\"{{ChannelPurposeMaxLength}}\" tabindex=\"1\">{{unFormatMessage model_ob.purpose.value}}<\/textarea>\n\t<span class=\"modal_input_note\">\n\t\t{{#t}}Give your channel a purpose that describes what it will be used for.{{\/t}}\n\t\t{{#if model_ob.purpose.creator}}\n\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t<br \/>\n\t\t\t\t{{#t creator_name=(makeMemberPreviewLinkById model_ob.purpose.creator) date=(toCalendarDate model_ob.purpose.last_set)}}The purpose was last set by {creator_name} on {date}.{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/span>\n<\/p>\n";
TS.raw_templates['coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"coachmark\" class=\"lato_regular normal hidden\">\n\t<div id=\"coachmark_callout\"><\/div>\n\t<div id=\"coachmark_interior\" class=\"lato\">\n\t\t{{! content divs are dynamically added depending on what type of coachmark is being shown }}\n\t\t<div id=\"coachmark_footer\">\n\t\t\t<div class=\"coachmark_footer_text\">\n\t\t\t\t{{#t}}<span>Done? <\/span><a class=\"coachmark_skip_link\">Click here to skip<\/a>{{\/t}}\n\t\t\t<\/div>\n\t\t\t<a class=\"btn coachmark_got_it float_right {{#feature flag=\"feature_update_coachmarks_copy\"}}hidden{{\/feature}}\">{{#t}}Got it!{{\/t}}<\/a>\n\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t<a class=\"btn coachmark_next_tip float_right\">{{#t}}Next Tip{{\/t}}<\/a>\n\t\t\t{{\/feature}}\n\n\t\t\t{{#feature flag=\"feature_update_coachmarks_cta\"}}\n\t\t\t\t{{#if can_include_invite_cta}}\n\t\t\t\t<a class=\"btn coachmark_invite_people float_right hidden\">{{#t}}Invite People{{\/t}}<\/a>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/feature}}\n\t\t<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channels_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n{{!-- TODO: move to separate templates... so many conditions --}}\n<div id=\"channels_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t{{#t}}Messaging happens in channels{{\/t}}\n\t\t\t{{~else~}}\n\t\t\t\t{{#if_gt total_count compare=1~}}\n\t\t\t\t\t{{#t}}These are your channels{{\/t}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{~#if in_single_private_channel~}}\n\t\t\t\t\t\t{{#t}}This is your private channel{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#t}}This is your channel{{\/t}}\n\t\t\t\t\t{{~\/if~}}\n\t\t\t\t{{~\/if_gt~}}\n\t\t\t{{\/feature}}\n\t\t<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t<p>{{#t}}Channels bring order and searchability to your team\u2019s conversations. Organize by topic (#research), working group (#sales), or specific project (#sales-tv-ad).{{\/t}}<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>{{#t}}Channels are chat rooms based around a project, a topic (such as <em>music<\/em>), or a team (such as <em>sales<\/em>). Channels can be public or private.{{\/t}}<\/p>\n\t\t\t{{\/feature}}\n\t\t{{~else~}}\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t<p>{{#if in_single_private_channel~}}\n\t\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t\t{{#t}}Channels organize your team's conversations by topic or working group. As a guest,{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#t}}Private channels are invite-only rooms. You only have access to this channel right now.{{\/t}}\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t\t{{~#if_equal total_count compare=1~}}\n\t\t\t\t\t\t\t{{#t first_listed_channel=(firstListedChannel)}}Channels organize your team's conversations by topic or working group. As a guest, you can send messages and browse archives in one channel, <strong>{first_listed_channel}<\/strong>.{{\/t}}\n\t\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t\t{{#t}}Channels organize your team's conversations by topic or working group. As a guest, you can send messages and browse archives in the channels listed here.{{\/t}}\n\t\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t}}Channels are chat rooms based around a project, a topic (such as <em>music<\/em>), or a team (such as <em>sales<\/em>).{{\/t}}\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t{{~\/if~}}\n\t\t\t\t{{~#unless in_single_private_channel~}}\n\t\t\t\t\t{{~#currentUserIsURA}}\n\t\t\t\t\t\t\t{{!-- Don't show anything --}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t\t\t{{!-- Don't show anything --}}\n\t\t\t\t\t\t{{else~}}\n\t\t\t\t\t\t\t{{~#if_equal total_count compare=1}} {{#t}}You have access to just one channel right now.{{\/t}}\n\t\t\t\t\t\t\t{{~else}} {{#t team_name=(currentTeamName)}}You have access to these channels in <strong>{team_name}<\/strong>.{{\/t}}\n\t\t\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t\t\t{{\/feature}}\n\t\t\t\t\t{{~\/currentUserIsURA~}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t\t{{#t}}you can access one channel, <span class=\"no_wrap\"><ts-icon class=\"ts_icon_lock\"><\/ts-icon><strong>{first_group_channel_name}<\/strong><\/span>. This is a private, invitation-only channel.{{\/t}}\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t{{~\/unless}}<\/p>\n\t\t\t{{~else~}}\n\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t<p>{{#t}}Channels bring order and searchability to your team\u2019s conversations. They\u2019re organized by topic (#research), working group (#sales), or specific project (#sales-tv-ad).{{\/t}}<\/p>\n\t\t\t\t{{else}}\n\t\t\t\t\t<p>{{#t team_name=(currentTeamName)}}Channels are chat rooms created by people in your Slack team. You've been added to some channels already. Channels can be public or private, and you can <strong>join any public channel<\/strong> in <strong>{team_name}<\/strong>.{{\/t}}<\/p>\n\t\t\t\t{{\/feature}}\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\t\t\n";
TS.raw_templates['invites_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"invites_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t<h2 class=\"black\">{{#t}}You\u2019re set &mdash; just add teammates{{\/t}}<\/h2>\n\t\t\t{{~#currentUserIsAdmin~}}\n\t\t\t\t<p>{{#t}}To get the most out of Slack, invite some coworkers and start messaging!{{\/t}}<\/p>\n\t\t\t{{~else~}}\n\t\t\t\t<p>{{#t}}To get the most out of Slack, invite some more coworkers and start messaging!{{\/t}}<\/p>\n\t\t\t{{~\/currentUserIsAdmin~}}\n\t\t{{else}}\n\t\t\t{{#t team_name=(currentTeamName)}}\n\t\t\t<h2 class=\"black\">Invite people to your team<\/h2>\n\t\t\t<p>To invite coworkers to <strong>{team_name}<\/strong>, click the <strong>Invite People<\/strong> button.<\/p>\n\t\t\t{{\/t}}\n\t\t{{\/feature}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['direct_messages_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"direct_messages_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Send direct messages{{\/t}}<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t<p>{{#t}}Need to send a quick note to just one person or a small group of people on your team? Direct messages are great for that!{{\/t}}<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>{{#t}}Direct messages are private, <strong>1-to-1 messages<\/strong>. Once you invite people, you\u2019ll be able to chat with them here.{{\/t}}<\/p>\n\t\t\t{{\/feature}}\n\t\t{{~else~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t<p>{{#t}}Need to send a quick note to just one person or a small group of people on your team?{{\/t}}\n\t\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t\t{{~#if_equal channels_count compare=0}} \n\t\t\t\t\t\t{{#t}}You can send direct messages to anyone in the same channel as you.{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{~#if_gt groups_count compare=0}}\n\t\t\t\t\t\t\t{{#t}}You can directly message anyone in the same channels or groups as you.{{\/t}}\n\t\t\t\t\t\t{{~else}}\n\t\t\t\t\t\t\t{{#t}}You can directly message anyone in the same {channels_count, plural, =1 {channel} other {channels}} as you.{{\/t}}\n\t\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t{{~else}} \n\t\t\t\t\t{{#t}}Direct messages are great for that.{{\/t}}\n\t\t\t\t{{~\/currentUserIsRA~}}\n\t\t\t\t<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>{{#t}}Direct messages are private, <strong>1-to-1 messages<\/strong>.{{\/t}}\n\t\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t\t{{~#if_equal channels_count compare=0}} {{#t}}You can directly message anyone in the same group as you.{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{~#if_gt groups_count compare=0}} {{#t}}You can directly message anyone in the same channels or groups as you.{{\/t}}\n\t\t\t\t\t\t{{~else}} {{#t}}You can directly message anyone in the same {channels_count, plural, =1 {channel} other {channels}} as you.{{\/t}}\n\t\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t{{~else}} {{#t team_name=(currentTeamName)}}You can chat with any member of <strong>{team_name}<\/strong>.{{\/t}}\n\t\t\t\t{{~\/currentUserIsRA~}}\n\t\t\t\t<\/p>\n\t\t\t{{\/feature}}\n\t\t\t\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['highlights_arrows_coachmark'] = "{{i18n_ns 'highlights_coachmark'}}\n\n<div id=\"highlights_arrows_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<p>{{#t}}<strong>Skip straight to your highlights<\/strong> with the click<br \/> of a button.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['highlights_message_coachmark'] = "{{i18n_ns 'highlights_coachmark'}}\n\n<div id=\"highlights_message_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Highlights{{\/t}}<\/h2>\n\t\t<p>{{#t}}Lots to read? Try starting with the highlights. They\u2019re<br \/> Slack\u2019s best guess at what\u2019s important to you.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['recent_mentions_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"recent_mentions_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span>{{#t}}<strong class=\"black\">Click<\/strong> to learn more about @ mentions.{{\/t}}<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t{{#t}}\n\t\t<h2 class=\"black\">All your @ mentions in one place<\/h2>\n\t\t<p>Anytime someone mentions your name or any of your highlight words, the message will be listed here.<\/p>\n\t\t{{\/t}}\n\t<\/div>\n<\/div>\n";
