TS.raw_templates['at_channel_warning_dialog'] = "{{i18n_ns 'at_channel'}}\n\n\t<div class=\"modal-body\">\n\t\t<p>\n\t\t\t{{#if_equal timezone_count compare=1}}\n\t\t\t\t{{#t}}By using <span class=\"mention_yellow_bg\">@{keyword}<\/span>, you are about to notify <strong>{member_count, plural, =1 {# person} other {# people}}<\/strong>. Are you sure?{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}By using <span class=\"mention_yellow_bg\">@{keyword}<\/span>, you are about to notify <strong>{member_count, plural, =1 {# person} other {# people}}<\/strong> in <strong>{timezone_count} timezones<\/strong>. Are you sure?{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t<\/p>\n\t\t<div>\n\t\t\t<button type=\"button\" class=\"btn btn_outline small_right_margin dialog_cancel\">{{#t}}Edit message{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_success dialog_go\">{{#t}}Send it now{{\/t}}<\/button>\n\t\t<\/div>\n\t\t<div>\n\t\t\t<span class=\"tiny dialog_cancel_hint\">{{#t}}<strong aria-label=\"escape\">Esc<\/strong> to edit{{\/t}}<\/span>\n\t\t\t<span class=\"tiny dialog_go_hint\">{{#t}}<strong aria-label=\"return\">Return <span class=\"return_char\">&crarr;<\/span><\/strong> to send{{\/t}}<\/span>\n\t\t<\/div>\n{{#currentUserIsAdmin}}\n\t\t<div>\n\t\t\t<span class=\"tiny dialog_admin_hint\">{{#t}}Pssst... admins! <a href=\"\/admin\/settings#permissions\" target=\"_blank\">Team settings<\/a> control this warning{{\/t}}<\/span>\n\t\t<\/div>\n{{else}}\n\t\t<div>\n\t\t\t<span class=\"tiny dialog_admin_hint\">{{#t}}Psssssst! These warnings can be modified by a Team Admin!{{\/t}}<\/span>\n\t\t<\/div>\n{{\/currentUserIsAdmin}}\n\n\t\t<div class=\"channel_members popover_menu hidden\">\n\t\t\t<div class=\"channel_members_scroller\"><\/div>\n\t\t\t<a href=\"#\" class=\"channel_members_count_underlay overflow_ellipsis\">{{#t}}{member_count, plural, =1 {# person} other {# people}}{{\/t}}<\/a>\n\t\t<\/div>\n\t<\/div>\n";
