TS.raw_templates['channel_browser_footer'] = "{{i18n_ns \"channel_browser\"}}\n\n<div id=\"channel_browser_footer\" class=\"channel_modal_footer\">\n\t<a class=\"greigh right_margin about_channels\"><i class=\"ts_icon ts_icon_info_circle small_right_margin\"><\/i>{{#t}}About channels...{{\/t}}<\/a>\n\t<a class=\"greigh\" href=\"\/archives\/archived\" target=\"_blank\"><i class=\"ts_icon ts_icon_archive small_right_margin\"><\/i>{{#t}}View archived channels...{{\/t}}<\/a>\n<\/div>\n";
TS.raw_templates['channel_new_modal'] = "{{i18n_ns 'channel_modal'}}\n\n<div id=\"new_channel_modal\" class=\"channel_modal\">\n\t<div>\n\t\t<h1 class=\"channel_modal_header\">\n\t\t\t<span class=\"public_channel_item{{#unless is_public}} hidden{{\/unless}}\">{{#t}}Create a channel{{\/t}}<\/span>\n\t\t\t<span class=\"private_channel_item{{#is_public}} hidden{{\/is_public}}\">{{#t}}Create a private channel{{\/t}}<\/span>\n\t\t<\/h1>\n\t\t<p class=\"input_note_special medium_bottom_margin\">{{#t}}Channels are where your team communicates. They\u2019re best when organized around a topic \u2014 #leads, for example.{{\/t}}<\/p>\n\t<\/div>\n\t<div class=\"bottom_margin\">\n\t\t{{#if can_toggle_private}}\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"channel_public_private_toggle\" type=\"checkbox\" name=\"public\" value=\"public\" {{#is_public}}checked=\"checked\"{{\/is_public}} data-style=\"toggle\" data-on-text=\"{{#t}}Public{{\/t}}\" data-off-text=\"{{#t}}Private{{\/t}}\" data-label=\"{{#t}}Anyone on your team can view and join this channel.{{\/t}}\" data-off-label=\"{{#t}}This channel can only be joined or viewed by invite.{{\/t}}\" data-off-class=\"ts_toggle_orange\">\n\t\t\t<\/label>\n\t\t{{\/if}}\n\t\t{{#feature flag=\"feature_tos_oct2016\"}}\n\t\t{{else}}\n\t\t\t<p class=\"private_channel_item input_note bottom_margin {{#is_public}}hidden{{\/is_public}}\">\n\t\t\t\t{{~#if compliance_exports_enabled_for_team~}}\n\t\t\t\t\t{{#t new_win_name=(newWindowName)}}Although this channel will be private, its contents may be accessible to your team owners via <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/203950296-FAQs-about-Slack-s-policy-update#complianceexport\" target=\"{new_win_name}\">compliance exports{{\/t}}<\/a>.\n\t\t\t\t{{\/if~}}\n\t\t\t<\/p>\n\t\t{{\/feature}}\n\t<\/div>\n\t<div>\n\t\t<div class=\"bottom_margin\">\n\t\t\t<label for=\"channel_create_title\" class=\"block align_left\">{{#t}}Name{{\/t}}<\/label>\n\t\t\t<div class=\"channel_modal_title_input_container no_margin\">\n\t\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon {{#is_public}}hidden{{\/is_public}}\" \/>\n\t\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon {{#unless is_public}}hidden{{\/unless}}\" \/>\n\t\t\t\t<input id=\"channel_create_title\" name=\"title_input\" type=\"text\" class=\"title_input large_left_padding\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" placeholder=\"{{#t}}e.g. leads{{\/t}}\" data-validation=\"channel_name\" data-validation-for=\"channel_create_title\" data-validation-success=\"\"\/>\n\t\t\t<\/div>\n\t\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t\t{{#t}}Names must be lowercase, with no spaces, and unique.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden name_taken_warning margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}That name is already taken by a channel, username, or user group.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden invalid_chars_warning margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t{{#t}}We changed your name so it doesn't contain disallowed characters. If it looks good, click \"Create Channel\" again!{{\/t}}\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden other_error margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t<span class=\"error_message\"><\/span>\n\t\t\t<\/span>\n\t\t<\/div>\n\n\t\t{{#unless is_ra}}\n\t\t<div class=\"medium_bottom_margin\">\n\t\t\t<label for=\"channel_purpose_input\" class=\"block align_left\">\n\t\t\t\t{{#t}}\n\t\t\t\tPurpose\n\t\t\t\t<span class=\"greigh normal\">(optional)<\/span>\n\t\t\t\t{{\/t}}\n\t\t\t<\/label>\n\t\t\t<input id=\"channel_purpose_input\" name=\"channel_purpose_input\" type=\"text\" maxlength=\"{{ChannelPurposeMaxLength}}\" placeholder=\"\"\/>\n\t\t\t<span class=\"modal_input_note margin_auto\">{{#t}}What\u2019s this channel about?{{\/t}}<\/span>\n\t\t<\/div>\n\t\t{{\/unless}}\n\n\t\t<div class=\"bottom_margin\">\n\t\t\t<label for=\"invite_members_input\" class=\"block align_left\">\n\t\t\t\t{{#t}}\n\t\t\t\tSend invites to:\n\t\t\t\t<span class=\"greigh normal\">(optional)<\/span>\n\t\t\t\t{{\/t}}\n\t\t\t<\/label>\n\t\t\t<div id=\"invite_members_container\"><\/div>\n\t\t<\/div>\n\t<\/div>\n\t<div class=\"new_channel_modal_footer\">\n\t\t<button id=\"save_channel\" class=\"btn btn_large new_channel_go ladda-button float_right\" type=\"submit\" data-style=\"expand-right\"><span class=\"ladda-label\">{{#t}}Create Channel{{\/t}}<\/span><\/button>\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button new_channel_cancel_btn\"><span class=\"ladda-label\">{{#t}}Cancel{{\/t}}<\/span><\/button>\n\t<\/div>\n<\/div>";
TS.raw_templates['channel_invite_modal'] = "{{i18n_ns 'channel_invite'}}\n\n<div id=\"channel_invite_modal\" class=\"channel_modal_with_list channel_modal\">\n\t<h1 class=\"large_bottom_margin channel_modal_header\">\n\t\t{{#if is_private}}\n\t\t\t{{#t icon=\"ts_icon_lock\"}}Invite others to <i class=\"ts_icon {icon}\"><\/i>{channel_name}{{\/t}} {{#if is_shared}}<i class=\"ts_icon ts_icon_org_shared_channel\"><\/i>{{\/if}}\n\t\t{{else}}\n\t\t\t{{#t icon=\"ts_icon_channel\"}}Invite others to <i class=\"ts_icon {icon}\"><\/i>{channel_name}{{\/t}} {{#if is_shared}}<i class=\"ts_icon ts_icon_org_shared_channel\"><\/i>{{\/if}}\n\t\t{{\/if}}\n\t<\/h1>\n\n\t{{#if is_private}}\n\t\t<div id=\"private_channel_invite_step_one\" class=\"\">\n\t\t\t{{#t}}\n\t\t\t<p class=\"bold\">Should new members be allowed to see the channel's message history?<\/p>\n\n\t\t\t<p><span class=\"bold\">If Yes<\/span>, new members will be invited and will have access to this channel's entire message history.<\/p>\n\n\t\t\t<p>\n\t\t\t\t<span class=\"bold\">If No<\/span>,\n\t\t\t\tthis channel will be renamed and archived. A new channel will be created with all current members plus the new ones you invite.\n\t\t\t\tYou and other current members will see a link back to the original channel's archives.\n\t\t\t<\/p>\n\n\t\t\t<div>\n\t\t\t\t<button class=\"btn btn_info right_margin no_create_channel\">No, start a new channel<\/button>\n\t\t\t\t<button class=\"btn btn_primary yes_show_history\">Yes, show channel history<\/button>\n\t\t\t<\/div>\n\t\t\t{{\/t}}\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#pageNeedsEnterprise}}\n\t\t<div class=\"channel_invite_filter_container full_width{{#if is_private}} hidden{{\/if}}\">\n\t\t\t<div class=\"float_right left_margin\">\n\t\t\t\t<button class=\"btn btn_primary btn_large {{#unless preselected}}disabled{{\/unless}} invite_go ladda-button\" data-style=\"zoom-in\">\n\t\t\t\t\t<span class=\"ladda-label\">{{#t}}Invite{{\/t}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t\t<div class=\"subtle_silver mini align_right tiny_right_margin return_hint\">{{#t}}Return <i class=\"ts_icon ts_icon_enter ts_icon_inherit\"><\/i>{{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t\t{{> channel_invite_tokens members=preselected}}\n\t\t\t{{> channel_kb_nav_label multiple_select=true}}\n\t\t<\/div>\n\t\t<div id=\"filter_invite_empty\" class=\"hidden align_center margin_auto display_flex align_items_center justify_content_center\">\n\t\t\t<span class=\"filter_invite_empty_message\"><\/span>\n\t\t<\/div>\n\t{{\/pageNeedsEnterprise}}\n\n\t<div id=\"channel_invite_container\" class=\"{{#pageNeedsEnterprise}}page_needs_enterprise channel_modal_list {{\/pageNeedsEnterprise}}{{#if is_private}}hidden{{\/if}}\"><\/div>\n<\/div>\n";
