TS.raw_templates['user_group_alerts'] = "{{i18n_ns \"alerts\"}}\n\n{{#if_equal error compare=\"forbidden_name\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}The name \"{group_name}\" is reserved and cannot be used.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"name_already_exists\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}A User Group already has the name \"{group_name}\".{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"handle_already_exists\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}The group name \"@{group_handle}\" is already in use. Group names cannot be the same as channel names or usernames.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"missing_subteam_name\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}A User Group must have a name.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"bad_handle\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}The handle must be lowercase and cannot contain spaces.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"forbidden_handle\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}The group name \"@{group_handle}\" is reserved and cannot be used.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"no_users_provided\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>{{#t}}User Groups must have members.{{\/t}}<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if can_create_auto_owners}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}Trying to create a group for all Team Owners? <a href=\"#auto-group\" data-auto-type=\"owners\" data-auto-action=\"create\" class=\"user_group_auto_action\">Make an automatic one<\/a> that's always up to date.{{\/t}}<\/p>\n{{\/if}}\n\n{{#if can_enable_auto_owners}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}Trying to create a group for all Team Owners? <a href=\"#auto-group\" data-auto-type=\"owners\" data-auto-action=\"enable\" class=\"user_group_auto_action\">Re-enable the automatic one<\/a> that's always up to date.{{\/t}}<\/p>\n{{\/if}}\n\n{{#if can_create_auto_admins}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}Trying to create a group for all Team Admins? <a href=\"#auto-group\" data-auto-type=\"admins\" data-auto-action=\"create\" class=\"user_group_auto_action\">Make an automatic one<\/a> that's always up to date.{{\/t}}<\/p>\n{{\/if}}\n\n{{#if can_enable_auto_admins}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>{{#t}}Trying to create a group for all Team Admins? <a href=\"#auto-group\" data-auto-type=\"admins\" data-auto-action=\"enable\" class=\"user_group_auto_action\">Re-enable the automatic one<\/a> that's always up to date.{{\/t}}<\/p>\n{{\/if}}\n";
TS.raw_templates['user_group_modal'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_groups_container\">\n\n\t<div id=\"all_user_groups\">\n\t\t<div id=\"user_groups_header\" class=\"clearfix bottom_border\">\n\t\t\t{{#if show_user_groups_add}}\n\t\t\t\t<a data-action=\"open_form\" class=\"btn float_right\">{{#t}}Create a new group{{\/t}}<\/a>\n\t\t\t{{\/if}}\n\t\t\t<h1>{{#t}}User Groups{{\/t}}<\/h1>\n\t\t\t<div class=\"user_groups_search\">\n\t\t\t\t<i class=\"icon_search ts_icon ts_icon_search\"><\/i>\n\t\t\t\t<a class=\"ts_icon ts_icon_times_circle icon_close hidden\"><\/a>\n\t\t\t\t<input id=\"user_group_modal_search\" type=\"text\" class=\"member_filter no_margin small\" name=\"team_filter\" placeholder=\"{{#t}}Find by name{{\/t}}\" \/>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t{{#ifClient}}\n\t\t\t{{#if show_info_pane}}\n\t\t\t\t<div class=\"info_panel clearfix\">\n\t\t\t\t\t<p>\n\t\t\t\t\t\t{{#t note=\"note explaining user groups\"}}While commands like <span class=\"mention\">@everyone<\/span>, <span class=\"mention\">@channel<\/span>, and <span class=\"mention\">@here<\/span> call the attention of team members in a conversation, User Groups let you choose exactly who should get your message.{{\/t}}\n\t\t\t\t\t<\/p>\n\t\t\t\t\t<p class=\"col span_3_of_4 no_bottom_margin\">\n\t\t\t\t\t\t{{#t note=\"note explaining how to set up a user group\"}}Choose a group name, like <span class=\"mention\">@design<\/span> or <span class=\"mention\">@marketing<\/span>, then select the group members. Now, when someone on your team mentions the User Group, only its members will be notified. You can even add those team members to channels of your choice automatically!{{\/t}}<br>\n\t\t\t\t\t\t<a data-action=\"hide_info_pane\" class=\"lato_bold\">{{#t}}Ok, you can hide this now{{\/t}}<\/a>\n\t\t\t\t\t<\/p>\n\t\t\t\t\t<div class=\"col span_1_of_4 top_margin no_padding\">\n\t\t\t\t\t\t<span class=\"user_groups_img\"><\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t{{\/ifClient}}\n\t\t<div id=\"user_groups_list_scroller\">\n\t\t\t{{!-- hbslint-disable syntax --}}\n\t\t\t{{!-- TODO: Enable syntax linter and refactor to use a safeString --}}\n\t\t\t<div id=\"user_groups_list_div\">{{{loadingHTML}}}<\/div>\n\t\t\t{{!-- hbslint-enable syntax --}}\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"user_groups_form_div\" class=\"hidden\"><\/div>\n\n\t<div id=\"user_groups_toggle_div\" class=\"hidden\"><\/div>\n\n<\/div>\n";
TS.raw_templates['user_group_settings_form'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_groups_header\" class=\"clearfix\">\n\t<h1 class=\"channel_modal_header\">{{#if this.id}}{{#t note=\"heading for editing a user group\" name=this.name}}Edit {name}{{\/t}}{{else}}{{#t note=\"heading for creating a user group\"}}Create a user group{{\/t}}{{\/if}}<\/h1>\n<\/div>\n\n<p class=\"input_note medium_bottom_margin\">{{#unless this.id}}{{#t}}User groups make it easy to get the attention of many team members at once. When you use a group\u2019s handle \u2014 like @accounts, for example \u2014 everyone in that group will be notified.{{\/t}}{{\/unless}}<\/p>\n\n<div id=\"user_group_alerts\"><\/div>\n\n<form class=\"user_group_settings_form\">\n\t{{#if this.is_external}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> {{#t}}The name of this User Group is managed by an external service. Use that service if you wish to rename this User Group.{{\/t}}<\/p>\n\t{{\/if}}\n\n\t{{#if this.auto_type}}\n\t\t<p class=\"alert alert_info\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t{{#if_equal this.auto_type compare=\"admin\"}}\n\t\t\t\t{{#t}}This User Group is automatically generated for team admins.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}This User Group is automatically generated for team owners.{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t<\/p>\n\t{{\/if}}\n\n\t<p>\n\t\t<label for=\"user_group_name_input\">{{#t note=\"label for user group name input\"}}Name{{\/t}}<\/label>\n\t\t<input id=\"user_group_name_input\" type=\"text\" class=\"no_bottom_margin {{#or this.is_external this.auto_type}}disabled{{\/or}}\" name=\"name\" value=\"{{this.name}}\" maxlength=\"100\" placeholder=\"{{#t note=\"placeholder text for user group name input\"}}e.g. Accounts Team{{\/t}}\" {{#or this.is_external this.auto_type}}disabled{{\/or}}\/>\n\t<\/p>\n\n\t<p class=\"handle_input empty\">\n\t\t<label for=\"user_group_handle_input\">{{#t note=\"label for user group handle input\"}}Handle{{\/t}}<\/label>\n\t\t<span class=\"icon_at\">@<\/span>\n\t\t<input id=\"user_group_handle_input\" type=\"text\" class=\"no_bottom_margin\" name=\"handle\" value=\"{{this.handle}}\" maxlength=\"100\" placeholder=\"e.g. @accounts\"\/><br \/>\n\t\t<span class=\"input_note\">{{#t}}You\u2019ll use this handle to get the group\u2019s attention. It should be all lowercase, with no spaces.{{\/t}}<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"description\">{{#t note=\"label for optional user group purpose input\"}}Purpose <span class=\"subtle_silver normal\">(optional)<\/span>{{\/t}}<\/label>\n\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"description\" value=\"{{this.description}}\" placeholder=\"\" maxlength=\"140\"\/>\n\t\t<span class=\"input_note\">{{#t note=\"help text below user group purpose input\"}}What\u2019s this group about?{{\/t}}<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"user_group_default_channels\">{{#t note=\"label for optional user group default channels input\"}}Default channels: <span class=\"subtle_silver normal\">(optional)<\/span>{{\/t}}<\/label>\n\t\t<select class=\"hidden\" multiple=\"true\" id=\"user_group_default_channels\" name=\"defaultchannels[]\"><\/select>\n\t\t{{#if this.user_count}}\n\t\t\t<span class=\"input_note\">{{#t note=\"help text below user group default channels input\"}}New members will be automatically added to default channels. Existing members will be added immediately.{{\/t}}<\/span>\n\t\t{{else}}\n\t\t\t<span class=\"input_note\">{{#t note=\"help text below user group default channels input\"}}Group members are added to these channels automatically.{{\/t}}<\/span>\n\t\t{{\/if}}\n\t<\/p>\n\n\t<button id=\"save_user_group\" type=\"submit\" class=\"btn btn_large ladda-button float_right\"><span class=\"ladda-label\">{{#if this.id}}{{#t}}Save{{\/t}}{{else}}{{#t}}Create Group{{\/t}}{{\/if}}<\/span><\/button>\n\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">{{#t}}Cancel{{\/t}}<\/span><\/button>\n\n<\/form>\n";
TS.raw_templates['user_group_members_form'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_groups_header\" class=\"clearfix\">\n\t<h1>{{#if is_new}}{{#t group_name=user_group.name}}Invite team members to {group_name}{{\/t}}{{else}}{{#t group_name=user_group.name}}Edit members of {group_name}{{\/t}}{{\/if}}<\/h1>\n<\/div>\n\n<form class=\"user_group_members_form\">\n\n\t{{#if user_group.is_external}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> {{#t note=\"warning shown beside user groups that cannot be edited because they are managed elsewhere\"}}The members of this User Group are managed by an external service. Use that service if you wish to edit this list.{{\/t}}<\/p>\n\t{{\/if}}\n\n\t{{#if user_group.auto_type}}\n\t\t<p class=\"alert alert_info\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t{{#if_equal user_group.auto_type compare=\"admin\"}}\n\t\t\t\t{{#t}}This User Group is automatically generated for team admins.{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}This User Group is automatically generated for team owners.{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t<\/p>\n\t{{\/if}}\n\n\t<p id=\"user_group_member_invite_div\">\n\t\t<label for=\"members\">{{#t note=\"label for text input for members to optionally send invitations to this user group\"}}Send invites to: <span class=\"subtle_silver normal\">(optional)<\/span>{{\/t}}<\/label>\n\t\t<select class=\"hidden\" multiple=\"true\" id=\"user_group_members_select\" name=\"members[]\"><\/select>\n\t\t{{#unless is_locked}}<span class=\"input_note\">{{#t note=\"note on alternative way to add members to user group\"}}You can also <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/212572638\" target=\"_blank\">import members from Active Directory using provisioning<\/a>.<\/span>{{\/t}}{{\/unless}}\n\t<\/p>\n\n\t{{#if is_locked}}\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">{{#t}}Ok{{\/t}}<\/span><\/button>\n\t{{else}}\n\t\t<button type=\"submit\" id=\"{{#if is_new}}create_group{{else}}save_group{{\/if}}\" class=\"btn btn_large float_right ladda-button\"><span class=\"ladda-label\">{{#if is_new}}{{#t note=\"submit a list of members to invite to a group\"}}Invite{{\/t}}{{else}}{{#t note=\"submit changes to a list of group members\"}}Save{{\/t}}{{\/if}}<\/span><\/button>\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">{{#t note=\"abandon changes to a list of group members\"}}Cancel{{\/t}}<\/span><\/button>\n\t{{\/if}}\n<\/form>\n";
TS.raw_templates['user_group_toggle'] = "{{i18n_ns 'user_groups'}}\n\n<div id=\"user_group_alerts\"><\/div>\n\n{{#if_equal action compare=\"delete_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>{{#t note=\"heading above delete a user group section\"}}Delete {user_group.name}?{{\/t}}<\/h1>\n\t\t<p>{{#t note=\"note explaining consequences of deleting a user group\"}}All the information about this User Group will be permanently deleted. This action cannot be undone.{{\/t}}<\/p>\n\t\t<a data-action=\"cancel\" class=\"btn btn_outline\">{{#t}}Cancel{{\/t}}<\/a>\n\t\t<a data-action=\"deleteUserGroup\" class=\"user_group_toggle_btn btn btn_danger\">{{#t}}Delete this group{{\/t}}<\/a>\n\t<\/div>\n{{\/if_equal}}\n{{#if_equal action compare=\"disable_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>{{#t note=\"heading above disable a user group section\"}}Disable {user_group.name}?{{\/t}}<\/h1>\n\t\t<p>\n\t\t\t{{#if user_group.handle}}\n\t\t\t\t{{#t}}\n\t\t\t\t\tIf you disable this User Group, you will not be able to use @{user_group.handle} or view the list of its members (you can re-enable it later).\n\t\t\t\t{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}\n\t\t\t\t\tIf you disable this User Group, you will not be able to view the list of its members (you can re-enable it later).\n\t\t\t\t{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t\t<a data-action=\"cancel\" class=\"btn btn_outline bottom_margin\">{{#t}}Cancel{{\/t}}<\/a>\n\t\t<a data-action=\"disableUserGroup\" class=\"user_group_toggle_btn btn bottom_margin\">{{#t}}Disable this group{{\/t}}<\/a>\n\t\t{{#if show_delete}}\n\t\t\t<p>{{#t}}You can also <a data-action=\"switch_delete_user_group\" class=\"lato_bold\">permanently delete this group.<\/a>{{\/t}}<\/p>\n\t\t{{\/if}}\n\t<\/div>\n{{\/if_equal}}\n{{#if_equal action compare=\"enable_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>{{#t group_name=user_group.name note=\"heading above enable a user group section\"}}Enable {group_name}?{{\/t}}<\/h1>\n\t\t{{#if user_group.handle}}<p>{{#t note=\"note explaining that the user group will notify its members if it is enabled\"}}If you enable, @{user_group.handle} will notify members of the group.{{\/t}}<\/p>{{\/if}}\n\t\t<a data-action=\"cancel\" class=\"btn btn_outline\">{{#t}}Cancel{{\/t}}<\/a>\n\t\t<a data-action=\"enableUserGroup\" class=\"user_group_toggle_btn btn\">{{#t}}Enable this group{{\/t}}<\/a>\n\t<\/div>\n{{\/if_equal}}\n";
