TS.raw_templates['prefs_win_lin_ssb'] = "{{i18n_ns 'win_prefs'}}\n\n<h2 id=\"prefs_app_settings\" class=\"inline_block\">{{#t}}App Settings{{\/t}}<\/h2>\n<p>\n\t{{#unless is_app_store_build}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"winssb_launch_on_start_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t\t{{#t}}Launch app on login{{\/t}}\n\t\t<\/label>\n\t{{\/unless}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"winssb_run_from_tray_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t{{#t}}Leave app running in notification area when the window is closed{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\" id=\"winssb_disable_hw_acceleration_pref\">\n\t\t<input id=\"winssb_disable_hw_acceleration_cb\" checked=\"unchecked\" type=\"checkbox\" data-inline-saver=\"#prefs_app_settings\">\n\t\t{{#t}}Disable hardware acceleration{{\/t}}<br>\n\t\t<span id=\"winssb_disable_hw_acceleration_note\" class=\"normal\">{{#unless show_lin_ssb_prefs}}{{#t}}If you use a Windows Classic theme, this can resolve rendering issues.{{\/t}}{{\/unless}}{{#t}}Restart Slack for this preference to take effect.{{\/t}}<\/span>\n\t<\/label>\n<\/p>\n";
TS.raw_templates['prefs_messages_media'] = "{{i18n_ns \"prefs\"}}\n\n<h2>{{#t}}Message Display{{\/t}}<\/h2>\n\n<h4 id=\"prefs_message_theme\" class=\"inline_block\">{{#t}}Message Theme{{\/t}}<\/h4>\n<div class=\"bottom_margin clearfix\">\n\t<div class=\"col span_1_of_2\">\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"messages_theme_select\" type=\"radio\" value=\"light_with_avatars\" data-inline-saver=\"#prefs_message_theme\">\n\t\t\t{{#t}}Clean: <span class=\"normal\">Clear, friendly, and focused.<\/span>{{\/t}}\n\t\t<\/label>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"messages_theme_select\" type=\"radio\" value=\"dense\" data-inline-saver=\"#prefs_message_theme\">\n\t\t\t{{#t}}Compact: <span class=\"normal\">The most messages you can fit on screen at once.<\/span>{{\/t}}\n\t\t<\/label>\n\t<\/div>\n\t<div class=\"col span_1_of_2\">\n\t\t<img src=\"{{versioned_prefs_messages_clean}}\" class=\"prefs_messages_theme_preview {{#unless clean_theme}}hidden{{\/unless}}\">\n\t\t<img src=\"{{versioned_prefs_messages_compact}}\" class=\"prefs_messages_theme_preview {{#unless compact_theme}}hidden{{\/unless}}\">\n\t<\/div>\n<\/div>\n\n<h4 id=\"prefs_display_options\" class=\"inline_block\">{{#t}}Display Options{{\/t}}<\/h4>\n<p class=\"large_bottom_margin\">\n\t<label class=\"checkbox\">\n\t\t<input id=\"show_typing_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t{{#t}}Display information about who is currently typing a message{{\/t}}\n\t<\/label>\n\t{{#feature flag=\"feature_name_tagging_client\"}}\n\t\t{{#feature flag=\"feature_name_tagging_preferred_name_pref\"}}\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"display_preferred_names_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t\t\t{{#t}}Display full names instead of preferred names{{\/t}}\n\t\t\t<\/label>\n\t\t{{\/feature}}\n\t{{else}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"display_real_names_override_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t\t{{#t note=\"(team_default) appears twice here, but one of them will be removed via JavaScript, so don't worry about redundancy\"}}Display real names <span id=\"display_real_names_default\">(team default)<\/span> instead of usernames <span id=\"display_usernames_default\">(team default)<\/span>{{\/t}}\n\t\t<\/label>\n\t{{\/feature}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"time24_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t{{#t}}Show times with 24-hour clock <span class=\"normal\">(16:00 rather than 4:00 PM)<\/span>{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"hide_hex_swatch_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t{{#t}}Display color swatches next to hexadecimal values{{\/t}}\n\t<\/label>\n\t{{#if should_use_local_lato_2}}\n\t\t{{#isOurApp}}\n\t\t\t{{! We don't show the Lato 2 pref in the SSB, since we load it locally for all users }}\n\t\t{{else}}\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"load_lato_2_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t\t\t{{#t new_win_name=(newWindowName)}}Use font with <a href=\"http:\/\/www.latofonts.com\/2014\/02\/27\/lato-2-0-released\/\" target=\"{new_win_name}\">extended latin character set<\/a><br>\n\t\t\t\t<span class=\"normal\">If you use a language with accented characters, this will improve font appearance. Requires reload to take effect.<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t{{\/isOurApp}}\n\t{{else}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"load_lato_2_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_display_options\">\n\t\t\t{{#t new_win_name=(newWindowName)}}Use font with <a href=\"http:\/\/www.latofonts.com\/2014\/02\/27\/lato-2-0-released\/\" target=\"{new_win_name}\">extended latin character set<\/a><br>\n\t\t\t<span class=\"normal\">If you use a language with accented characters, this will improve font appearance. Requires reload to take effect.<\/span>{{\/t}}\n\t\t<\/label>\n\t{{\/if}}\n<\/p>\n\n<h4 id=\"prefs_emoji_style\" class=\"inline_block\">{{#t}}Emoji Style{{\/t}}<\/h4>\n<br>\n<p id=\"prefs_emoji\" class=\"inline_block\">\n\t<label class=\"radio\">\n\t\t<input name=\"emoji_mode_select\" type=\"radio\" value=\"default\" data-inline-saver=\"#prefs_emoji_style\">\n\t\t<span class=\"emoji_label\">{{#t}}Apple\/International Style{{\/t}}<\/span>\n\t\t{{> prefs_emoji_preview force_style='apple' use_skin_tone_modifier=true}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"emoji_mode_select\" type=\"radio\" value=\"google\" data-inline-saver=\"#prefs_emoji_style\">\n\t\t<span class=\"emoji_label\">{{#t}}Google Hangouts Style{{\/t}}<\/span>\n\t\t{{> prefs_emoji_preview force_style='google'}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"emoji_mode_select\" type=\"radio\" value=\"twitter\" data-inline-saver=\"#prefs_emoji_style\">\n\t\t<span class=\"emoji_label\">{{#t}}Twitter Style{{\/t}}<\/span>\n\t\t{{> prefs_emoji_preview force_style='twitter' use_skin_tone_modifier=true}}\n\t<\/label>\n\t<label class=\"radio small_bottom_margin\">\n\t\t<input name=\"emoji_mode_select\" type=\"radio\" value=\"emojione\" data-inline-saver=\"#prefs_emoji_style\">\n\t\t<span class=\"emoji_label\">{{#t}}Emoji One Style{{\/t}}<\/span>\n\t\t{{> prefs_emoji_preview force_style='emojione'}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"emoji_mode_select\" type=\"radio\" value=\"as_text\" data-inline-saver=\"#prefs_emoji_style\">\n\t\t{{#t}}None: <span class=\"normal\">plain text only{{\/t}}<\/span>\n\t<\/label>\n<\/p>\n<p id=\"jumbomoji_pref\" class=\"large_bottom_margin{{#if_equal messages_theme compare=\"dense\"}} jumbomoji_pref_disabled{{\/if_equal}}\">\n\t<label class=\"checkbox\">\n\t\t<input id=\"jumbomoji_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_emoji_style\" {{#if_equal messages_theme compare=\"dense\"}}disabled=\"disabled\" aria-disabled=\"true\"{{\/if_equal}}>\n\t\t{{#t}}Show JUMBOMOJI<br>\n\t\t<span class=\"normal\">Display the jumbo versions of emoji (up to 23 at a time!) in messages without text.<\/span>\n\t\t<span class=\"jumbomoji_disabled_note\"><strong>Note:<\/strong> In compact mode, all emoji remain at a smaller, more sensible size.<\/span>{{\/t}}\n\t<\/label>\n<\/p>\n\n<h4 id=\"prefs_convert_emoticons\" class=\"inline_block\">{{#t}}Convert Emoticons{{\/t}}<\/h4>\n<p class=\"large_bottom_margin\">\n\t<label class=\"checkbox\">\n\t\t<input id=\"convert_emoticons_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_convert_emoticons\">\n\t\t{{#t smile_emoji=(emojiGraphicReplace \":smile:\")}}Convert my typed emoticons to emoji, so &nbsp;:D&nbsp; becomes {smile_emoji}{{\/t}}\n\t<\/label>\n<\/p>\n\n<hr>\n\n<h2 id=\"prefs_inline_media\" class=\"large_top_margin inline_block\">{{#t}}Inline Media & Links{{\/t}}<\/h2>\n<p>\n\t<label class=\"checkbox\">\n\t\t<input id=\"expand_internal_inline_imgs_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t}}Show images and files uploaded to Slack{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"expand_inline_imgs_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t}}Show images and files from linked websites{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox medium_left_margin\">\n\t\t<input id=\"dont_obey_inline_img_limit_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t file_size_limit=(convertFilesize inline_img_byte_limit)}}Even if they\u2019re larger than {file_size_limit}{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"expand_non_media_attachments_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_inline_media\">\n\t\t{{#t}}Show text previews of linked websites{{\/t}}\n\t<\/label>\n<\/p>\n";
TS.raw_templates['prefs_themes'] = "{{i18n_ns \"prefs\"}}\n\n<div id=\"prefs_themes\">\n\n\t{{#feature flag=\"feature_sli_channel_priority\"}}\n\t<h2 id=\"prefs_sidebar_sort\" class=\"inline_block\">{{#t}}Sidebar Settings [TS ONLY]{{\/t}}<\/h2>\n\t<div class=\"no_custom_sort hidden\">\n\t\t<h3>{{#t}}You are using our Default Sort.{{\/t}}<\/h3>\n\t\t{{#t}}Try a <a id=\"custom_sort_btn\" class=\"btn btn_small btn_outline\" style=\"line-height:.8rem\">Custom Sort<\/a> ?{{\/t}}<\/p>\n\n\t\t<p><label class=\"select\">{{#t note=\"Refers to channel list sorting\"}}What calculated ranking would you like to use?{{\/t}}<\/label>\n\t\t\t<select id=\"custom_sort_simple_select\" data-inline-saver=\"#prefs_sidebar_sort\" class=\"small\" style=\"width:300px\">\n\t\t\t\t{{#each channel_sort_simple_options}}\n\t\t\t\t<option value=\"{{this.value}}\">{{this.name}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t\t<\/select><br>\n\t\t<\/p>\n\n\t<\/div>\n\t<div class=\"has_custom_sort hidden\">\n\t\t{{#t}}<h3>You are using a Custom Sort.<\/h3>\n\t\t<p>Go back to the <a id=\"default_sort_btn\" class=\"btn btn_small btn_outline\" style=\"line-height:.8rem\">Default Sort<\/a> ?<\/p>{{\/t}}\n\n\t\t<p><label class=\"select\">{{#t note=\"Followed by various channel sorting options\"}}Choose what to sort on:{{\/t}}<\/label>\n\t\t\t{{#repeat channel_sort_options_cnt}}\n\t\t\t<select data-inline-saver=\"#prefs_sidebar_sort\" class=\"small custom_sort_select\" style=\"width:300px\">\n\t\t\t\t{{#each ..\/channel_sort_options}}\n\t\t\t\t<option value=\"{{this.value}}\">{{this.name}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t\t<\/select> <a class=\"channel_sort_remover channel_sort_remover\"><ts-icon class=\"ts_icon_times_circle subtle_silver candy_red_on_hover\"><\/ts-icon><\/a><br>\n\t\t\t{{\/repeat}}\n\t\t<\/p>\n\n\t<\/div>\n\n\t<p>\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"priority_display_cb\" checked=\"\" type=\"checkbox\" data-inline-saver=\"#prefs_sidebar_sort\">\n\t\t\t{{#t}}Show a priority score next to channels in the channel list <span class=\"normal\"><br>\n\t\t\tThis might be SLI's priority score, or might be frecency, depending on your sort preferences.<\/span>{{\/t}}\n\t\t<\/label>\n\t<\/p>\n\n\t<p class=\"bold very_small_bottom_margin\">{{#t}}In the sidebar, show:{{\/t}}<\/p>\n\t<p>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"\" checked=\"checked\" data-inline-saver=\"#prefs_sidebar_sort\">\n\t\t\t<span class='normal'>{{#t note=\"Option for what to show in the channel list\"}}All my channels and DMs{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"hide_read_channels\" data-inline-saver=\"#prefs_sidebar_sort\">\n\t\t\t<span class='normal'>{{#t note=\"Option for what to show in the channel list\"}}Just my unread channels and DMs{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"radio\">\n\t\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"hide_read_channels_unless_starred\" data-inline-saver=\"#prefs_sidebar_sort\">\n\t\t\t<span class='normal'>{{#t note=\"Option for what to show in the channel list\"}}My unreads, along with everything I've starred{{\/t}}<\/span>\n\t\t<\/label>\n\t<\/p>\n\t<p>\n\t\t<label for=\"separate_private_channels_cb\" class=\"checkbox no_margin\">\n\t\t\t<input id=\"separate_private_channels_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t\t<span class=\"normal\">{{#t note=\"Channel list checkbox preference\"}}List private channels separately{{\/t}}<\/span>\n\t\t<\/label>\n\t<\/p>\n\n\t<hr>\n\n\t{{\/feature}}\n\n\t<h2 id=\"prefs_sidebar_theme\" class=\"inline_block\">{{#t}}Sidebar Theme{{\/t}}<\/h2>\n\n\t<p>{{#t team_name=(currentTeamName)}}Customize the look of the <strong>{team_name}<\/strong> team. Only you will see this.{{\/t}}<\/p>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/aubergine@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"default_theme\" data-inline-saver=\"#prefs_sidebar_theme\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Aubergine{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/hoth@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"hoth_theme\" data-inline-saver=\"#prefs_sidebar_theme\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Hoth{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/monument@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"monument_theme\" data-inline-saver=\"#prefs_sidebar_theme\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Monument{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/chocolate@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"chocolate_theme\" data-inline-saver=\"#prefs_sidebar_theme\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Choco Mint{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/ochin@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"ocean_theme\" data-inline-saver=\"#prefs_sidebar_theme\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Ochin{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/workhard@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"workhard_theme\" data-inline-saver=\"#prefs_sidebar_theme\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Work Hard{{\/t}}<\/div>\n\t\t<\/div>\n\n\t<\/label>\n\n\t<hr class=\"clear_both large_top_margin large_bottom_margin\">\n\n\t<h4 id=\"prefs_sidebar_theme_accessible\" class=\"inline_block bottom_margin\">{{#t}}Accessible Themes{{\/t}}<\/h4><br>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/solanum@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"solanum_theme\" data-inline-saver=\"#prefs_sidebar_theme_accessible\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Protanopia &amp;<br \/>Deuteranopia{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<label class=\"radio theme_label\">\n\t\t<div class=\"theme_thumb\" style=\"background-image: url(\/img\/themes\/brinjal@2x.png);\"><\/div>\n\t\t<div class=\"theme_chooser\">\n\t\t\t<div class=\"theme_radio_wrap\">\n\t\t\t\t<input class=\"theme_radio\" name=\"sidebar_theme_rd\" type=\"radio\" value=\"brinjal_theme\" data-inline-saver=\"#prefs_sidebar_theme_accessible\">\n\t\t\t<\/div>\n\t\t\t<div class=\"theme_name\">{{#t note=\"A sidebar theme name\"}}Tritanopia{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/label>\n\n\t<hr class=\"clear_both large_top_margin large_bottom_margin\">\n\n\t<p id=\"customize_theme_info\" class=\"{{#if show_customization_ui}}hidden{{\/if}}\">\n\t\t{{#t}}Feeling adventurous?<br>\n\t\t<a id=\"customize_theme_toggle\" class=\"bold\">Customize your theme and share it with others<\/a>{{\/t}}\n\t<\/p>\n\n\t<div id=\"prefs_themes_customize\" class=\"{{#unless show_customization_ui}}hidden{{\/unless}}\">\n\t\t<h4 class=\"bottom_margin\">{{#t}}Custom Theme{{\/t}}<\/h4>\n\t\t<label>\n\t\t\t{{#t note=\"Sidebar column background\"}}Column BG{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='column_bg' data-hex='{{theme.column_bg}}' style=\"background-color: {{theme.column_bg}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_column_bg_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.column_bg}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label>\n\t\t\t{{#t note=\"Sidebar menu background hover\"}}Menu BG Hover{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='menu_bg' data-hex='{{theme.menu_bg}}' style=\"background-color: {{theme.menu_bg}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_menu_bg_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.menu_bg}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label>\n\t\t\t{{#t note=\"Active item in channel list sidebar\"}}Active Item{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='active_item' data-hex='{{theme.active_item}}' style=\"background-color: {{theme.active_item}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_active_item_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.active_item}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label>\n\t\t\t{{#t note=\"Active item text in channel list sidebar\"}}Active Item Text{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='active_item_text' data-hex='{{theme.active_item_text}}' style=\"background-color: {{theme.active_item_text}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_active_item_text_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.active_item_text}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label>\n\t\t\t{{#t}}Hover Item{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='hover_item' data-hex='{{theme.hover_item}}' style=\"background-color: {{theme.hover_item}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_hover_item_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.hover_item}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label>\n\t\t\t{{#t}}Text Color{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='text_color' data-hex='{{theme.text_color}}' style=\"background-color: {{theme.text_color}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_text_color_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.text_color}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label>\n\t\t\t{{#t}}Active Presence{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='active_presence' data-hex='{{theme.active_presence}}' style=\"background-color: {{theme.active_presence}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_active_presence_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.active_presence}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\t\t<label class=\"large_bottom_margin\">\n\t\t\t{{#t}}Mention Badge{{\/t}}<br>\n\t\t\t<span class=\"custom_theme_label\">\n\t\t\t\t<span class=\"color_swatch\" data-theme-element='badge' data-hex='{{theme.badge}}' style=\"background-color: {{theme.badge}};\"><\/span>\n\t\t\t\t<input type=\"text\" name=\"color_badge_hex\" class=\"small color_hex monospace borderless\" value=\"{{theme.badge}}\" maxlength=\"7\">\n\t\t\t<\/span>\n\t\t<\/label>\n\n\t\t<label class=\"clear_both full_width\">\n\t\t\t{{#t}}Copy and paste these values to share your custom theme with others:{{\/t}}<br>\n\t\t\t<input type=\"text\" name=\"sidebar_theme_custom\" id=\"sidebar_theme_custom\" class=\"small monospace very_small_top_margin\">\n\t\t<\/label>\n\n\t<\/div>\n<\/div>";
TS.raw_templates['prefs_search'] = "{{i18n_ns \"dialogs_prefs_search\"}}\n\n<h2 id=\"prefs_search_exclusion\" class=\"inline_block\">{{#t note=\"heading for preferences related to searching in Slack\"}}Search{{\/t}}<\/h2>\n<p>{{#t}}By default, Slack searches every channel. You can change this if you\u2019d like.{{\/t}}<\/p>\n<p>\n\t<label for=\"search_channel_exclusion\">{{#t}}Don\u2019t search these channels:{{\/t}}<\/label>\n\t<select multiple=\"multiple\" id=\"search_channel_exclusion\" size=\"30\" data-inline-saver=\"#prefs_search_exclusion\">\n\t\t<optgroup label=\"{{#t note=\"heading for a list of channels\"}}Active Channels{{\/t}}\">\n\t\t\t{{#each active_channels}}\n\t\t\t\t<option value=\"{{this.channel.id}}\"{{#if this.search_channel_exclusion}} selected{{\/if}}>#{{this.channel.name}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/optgroup>\n\t\t<optgroup label=\"{{#t note=\"heading for a list of channels\"}}Archived Channels{{\/t}}\">\n\t\t\t{{#each archived_channels}}\n\t\t\t\t<option value=\"{{this.channel.id}}\"{{#if this.search_channel_exclusion}} selected{{\/if}}>#{{this.channel.name}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/optgroup>\n\t<\/select>\n<\/p>";
TS.raw_templates['prefs_read_state_tracking'] = "{{i18n_ns \"dialogs_prefs_read_state_tracking\"}}\n\n<h2 id=\"prefs_read_state_tracking\" class=\"inline_block\">{{#t note=\"heading for read-state preferences\"}}Mark as Read{{\/t}}<\/h2>\n<p>{{#t}}Slack marks a channel read as soon as you view it. You can change this if you\u2019d like.{{\/t}}<\/p>\n\n<h4>{{#t}}When I view a channel:{{\/t}}<\/h4>\n<p class=\"large_bottom_margin\">\n\t<label class=\"radio\">\n\t\t<input name=\"read_rd\" type=\"radio\" value=\"immediate_scroll\" data-inline-saver=\"#prefs_read_state_tracking\">\n\t\t{{#t}}Start me where I left off, and mark the channel read{{\/t}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"read_rd\" type=\"radio\" value=\"immediate\" data-inline-saver=\"#prefs_read_state_tracking\">\n\t\t{{#t}}Start me at the newest message, and mark the channel read{{\/t}}\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"read_rd\" type=\"radio\" value=\"default\" data-inline-saver=\"#prefs_read_state_tracking\">\n\t\t{{#t}}Start me at the newest message, but leave unseen messages unread{{\/t}}\n\t<\/label>\n<\/p>\n\n<h4>{{#t note=\"heading for read-state shortcuts\"}}Shortcuts{{\/t}}<\/h4>\n<p class=\"small_bottom_margin\">\n\t{{emojiGraphicReplace \":information_desk_person::skin-tone-2:\" 'apple'}}\n\t{{#t}}<b>Mark a channel as read<\/b> by hitting the <em>Esc<\/em> key.{{\/t}}\n<\/p>\n<p class=\"small_bottom_margin\">\n\t{{emojiGraphicReplace \":ok_woman::skin-tone-4:\" 'apple'}}\n\t{{#t}}<b>Mark everything as read<\/b> by pressing <em>shift<\/em> + <em>esc<\/em>.{{\/t}}\n<\/p>\n<p>\n\t{{emojiGraphicReplace \":raising_hand::skin-tone-6:\" 'apple'}}\n\t{{#t modifier_key_name=short_key_name}}<b>Mark a message unread<\/b> by selecting <em>Mark unread<\/em> from the message's menu. Or simply hold down the <em>{modifier_key_name}<\/em> key and click on it.{{\/t}}\n<\/p>\n";
TS.raw_templates['prefs_a11y'] = "{{i18n_ns \"dialogs_prefs_accessibility\"}}\n\n<h2>{{#t note=\"heading for accessibility preferences\"}}Accessibility{{\/t}}<\/h2>\n\n{{#if zoom_pref_enabled}}\n\t<div class=\"a11y_pref_zoom\">\n\t\t<fieldset class=\"large_bottom_margin\">\n\t\t\t<legend id=\"prefs_a11y_font_size\">{{#t}}Zoom{{\/t}}<\/legend>\n\n\t\t\t<label class=\"radio normal\">\n\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"80\">\n\t\t\t\t{{#t note=\"setting for text size\"}}<strong>80%<\/strong>{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t<label class=\"radio normal\">\n\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"90\">\n\t\t\t\t{{#t note=\"setting for text size\"}}<strong>90%<\/strong>{{\/t}}\n\t\t\t<\/label>\t\t\t\n\n\t\t\t<label class=\"radio normal\">\n\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"normal\">\n\t\t\t\t{{#t note=\"setting for text size\"}}<strong>100%<\/strong> Default{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t<label class=\"radio normal\">\n\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"110\">\n\t\t\t\t{{#t note=\"setting for text size\"}}<strong>110%<\/strong>{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t<label class=\"radio normal\">\n\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"125\">\n\t\t\t\t{{#t note=\"setting for text size\"}}<strong>125%<\/strong>{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t<label class=\"radio normal\">\n\t\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"150\">\n\t\t\t\t{{#t note=\"setting for text size\"}}<strong>150%<\/strong>{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t<p class=\"greigh top_margin\">\n\t\t\t\t{{#isMac}}\n\t\t\t\t\t{{#t}}You can also change the zoom level by pressing Cmd +\/-{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}You can also change the zoom level by pressing Ctrl +\/-{{\/t}}\n\t\t\t\t{{\/isMac}}\n\t\t\t<\/p>\n\t\t<\/fieldset>\n\n\t\t<div class=\"preview_zoom\">\n\t\t\t<ts-message class=\"first\">\n\t\t\t\t<div class=\"message_gutter\">\n\t\t\t\t\t<div class=\"message_icon\">\n\t\t\t\t\t\t<div class=\"member_image thumb_36\" style=\"background-image: url(\/img\/slackbot_72.png)\" aria-hidden=\"true\"><\/div>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"message_content\">\n\t\t\t\t\t<div class=\"message_content_header\">\n\t\t\t\t\t\t<div class=\"message_content_header_left\">\n\t\t\t\t\t\t\t{{!-- hbslint-disable unwrapped --}}\n\t\t\t\t\t\t\t{{!-- Todo: enable unwrapped linter (maybe)? --}}\n\t\t\t\t\t\t\t<span class=\"message_sender color_USLACKBOT color_757575 member\">slackbot<\/span>\n\t\t\t\t\t\t\t{{!-- hbslint-enable unwrapped --}}\n\t\t\t\t\t\t\t<span class=\"timestamp\"><i class=\"copy_only\">[<\/i>2:39 PM<i class=\"copy_only\">]<\/i><\/span>\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<span class=\"message_body\">{{#t}}This is a preview of what a message will look like. Is this a comfortable experience?{{\/t}}<\/span>\n\t\t\t\t<\/div>\n\t\t\t<\/ts-message>\n\t\t<\/div>\n\t<\/div>\n{{\/if}}\n\n{{#if font_size_pref_enabled}}\n\t<fieldset class=\"large_bottom_margin\">\n\t\t<legend id=\"prefs_a11y_font_size\">{{#t}}Font Size{{\/t}}<\/legend>\n\n\t\t<label class=\"radio normal\">\n\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"normal\" data-inline-saver=\"#prefs_a11y_font_size\">\n\t\t\t{{#t note=\"setting for text size\"}}<strong>Default<\/strong> size at 100%{{\/t}}\n\t\t<\/label>\n\n\t\t<label class=\"radio normal\">\n\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"110\" data-inline-saver=\"#prefs_a11y_font_size\">\n\t\t\t{{#t note=\"setting for text size\"}}<strong>Medium<\/strong> size at 110%{{\/t}}\n\t\t<\/label>\n\n\t\t<label class=\"radio normal\">\n\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"125\" data-inline-saver=\"#prefs_a11y_font_size\">\n\t\t\t{{#t note=\"setting for text size\"}}<strong>Larger<\/strong> size at 125%{{\/t}}\n\t\t<\/label>\n\n\t\t<label class=\"radio normal\">\n\t\t\t<input name=\"a11y_font_size_select\" type=\"radio\" value=\"150\" data-inline-saver=\"#prefs_a11y_font_size\">\n\t\t\t{{#t note=\"setting for text size\"}}<strong>Largest<\/strong> size at 150%{{\/t}}\n\t\t<\/label>\n\t<\/fieldset>\n{{\/if}}\n\n<fieldset>\n\t<legend><span id=\"prefs_a11y_animations\">{{#t}}Animation{{\/t}}<\/span><\/legend>\n\t<label class=\"checkbox\">\n\t\t<input id=\"a11y_animations\" type=\"checkbox\" data-inline-saver=\"#prefs_a11y_animations\">\n\t\t{{#t}}Allow animated images and emoji{{\/t}}\n\t<\/label>\n<\/fieldset>";
TS.raw_templates['prefs_advanced'] = "{{i18n_ns 'prefs'}}\n\n<h2 id=\"prefs_input_options\" class=\"inline_block\">{{#t}}Input Options{{\/t}}<\/h2>\n<p>\n\t<label class=\"checkbox\">\n\t\t<input id=\"webapp_spellcheck_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}Enable spellcheck on your messages{{\/t}}\n\t<\/label>\n\t{{#feature flag=\"feature_name_tagging_client\"}}{{else}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"require_at_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}Only show autocomplete for people when the '@' character is used{{\/t}}\n\t<\/label>\n\t{{\/feature}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"enter_is_special_in_tbt_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}\n\t\tWhen typing code with ```, <em>Enter<\/em> should not send the message<br \/>\n\t\t<span class=\"normal greigh\">With this checked use <em>Shift+Enter<\/em> to send<\/span>\n\t\t{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"arrow_history_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_input_options\">\n\t\t{{#t}}Use <i class=\"ts_icon ts_icon_square_arrow_up ts_icon_inherit\"><\/i> and <i class=\"ts_icon ts_icon_square_arrow_down ts_icon_inherit\"><\/i> to cycle through your typed history<br>{{\/t}}\n\t\t<span class=\"normal greigh\">\n\t\t\t{{#isMac}}\n\t\t\t\t{{#t}}With this checked, use Cmd + <i class=\"ts_icon ts_icon_square_arrow_up ts_icon_inherit\"><\/i>&nbsp;to edit your last message{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}With this checked, use Ctrl  + <i class=\"ts_icon ts_icon_square_arrow_up ts_icon_inherit\"><\/i>&nbsp;to edit your last message{{\/t}}\n\t\t\t{{\/isMac}}\n\t\t<\/span>\n\t<\/label>\n<\/p>\n\n{{#if show_app_download_path}}\n<hr>\n<div class=\"clearfix\">\n\t<h2 id=\"prefs_download_location\" class=\"inline_block small_bottom_margin\">{{#t}}Download Location{{\/t}}<\/h2>\n\t<p class=\"small_bottom_margin\">{{#t}}Note: this setting is for this computer only and affects all teams you are signed in to.{{\/t}}<\/p>\n\t<div class=\"col span_3_of_4\"><input id=\"app_download_path_input\" type=\"text\" disabled=\"disabled\" value=\"{{app_download_path}}\" class=\"small\"><\/div>\n\t<div class=\"col span_1_of_4\"><button data-action=\"select_ssb_download_path\" class=\"btn btn_outline full_width\">{{#t}}Change &hellip;{{\/t}}<\/button><\/div>\n<\/div>\n{{\/if}}\n\n<hr>\n\n<h2 id=\"prefs_channel_list\" class=\"inline_block small_bottom_margin\">{{#t}}Channel List{{\/t}}<\/h2>\n<p class=\"bold\">{{#t}}In the sidebar, show:{{\/t}}<\/p>\n<p>\n\t<label class=\"radio\">\n\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"\" checked=\"checked\" data-inline-saver=\"#prefs_channel_list\">\n\t\t<span class='normal'>{{#t}}All my channels and DMs{{\/t}}<\/span>\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"hide_read_channels\" data-inline-saver=\"#prefs_channel_list\">\n\t\t<span class='normal'>{{#t}}Just my unread channels and DMs{{\/t}}<\/span>\n\t<\/label>\n\t<label class=\"radio\">\n\t\t<input name=\"pr_sidebar\" type=\"radio\" value=\"hide_read_channels_unless_starred\" data-inline-saver=\"#prefs_channel_list\">\n\t\t<span class='normal'>{{#t}}My unreads, along with everything I've starred{{\/t}}<\/span>\n\t<\/label>\n<\/p>\n<p>\n\t<label for=\"separate_private_channels_cb\" class=\"checkbox no_margin\">\n\t\t<input id=\"separate_private_channels_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t<span>{{#t}}List private channels separately{{\/t}}<\/span>\n\t<\/label>\n<\/p>\n\n<p>\n\t<label class=\"checkbox nor_margin\">\n\t\t<input id=\"enable_unread_view\" checked=\"\" type=\"checkbox\" data-inline-saver=\"#prefs_channel_list\">\n\t\t{{#t}}Turn on All Unreads<br \/>\n\t\t<span class=\"normal greigh\">This collects all the messages you\u2019ve missed in one handy place.<\/span>{{\/t}}\n\t<\/label>\n<\/p>\n\n<hr>\n\n<h2 id=\"prefs_other_options\" class=\"inline_block\">{{#t}}Other Options{{\/t}}<\/h2>\n<p>\n\n\t<label class=\"checkbox\">\n\t\t<input id=\"pagekeys_handled_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}<em>Page up<\/em>, <em>Page down<\/em>, <em>Home<\/em>, and <em>End<\/em> keys always scroll messages{{\/t}}\n\t<\/label>\n\n\t{{#isOurApp}}{{else}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"f_key_search_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t\t{{#isMac}}\n\t\t\t\t{{#t}}Cmd + F starts a Slack search<br>{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Ctrl + F starts a Slack search<br>{{\/t}}\n\t\t\t{{\/isMac}}\n\t\t\t<span class=\"normal greigh\">{{#t}}Overrides normal browser search behavior{{\/t}}<\/span>\n\t\t<\/label>\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"k_key_omnibox_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t\t{{#isMac}}\n\t\t\t\t{{#t}}Cmd + K starts the quick switcher<br>{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Ctrl + K starts the quick switcher<br>{{\/t}}\n\t\t\t{{\/isMac}}\n\t\t\t<span class=\"normal greigh\">{{#t}}Overrides normal behavior in some browsers{{\/t}}<\/span>\n\t\t<\/label>\n\t{{\/isOurApp}}\n\n\t<label class=\"checkbox\">\n\t\t<input id=\"no_omnibox_in_channels_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}Hide the quick switcher in the channel list{{\/t}}\n\t<\/label>\n\t{{#feature flag='feature_prev_next_button'}}\n\t\t<label class=\"checkbox\">\n\t\t\t<input id=\"prev_next_btn\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t\t{{#t}}Hide the previous and next button in the channel list{{\/t}}\n\t\t<\/label>\n\t{{\/feature}}\n\t<label class=\"checkbox\">\n\t\t<input id=\"ask_after_away_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}Ask if I want to toggle my away status when I log in after having set myself away{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"enable_chan_suggestions\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_other_options\">\n\t\t{{#t}}Send me occasional channel suggestions via Slackbot{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox\">\n\t\t<input id=\"surprise_me\" type=\"checkbox\">\n\t\t{{#t}}Surprise me!{{\/t}}\n\t<\/label>\n<\/p>\n\n<div id=\"surprise\" style=\"display: none;\">\n\t<img id=\"emo_bear\" src=\"\" style=\"width: 279px; height: 243px;\"><br>\n\t<h1 class=\"candy_red\">{{#t}}Surprise!{{\/t}}<\/h1>\n<\/div>\n\n<hr>\n\n<h2 id=\"prefs_debug\" class=\"inline_block\">{{#t}}Debugging Options{{\/t}}<\/h2>\n{{#if show_console_whitelist}}\n\t<p class=\"medium_bottom_margin\">\n\t\t<label for=\"client_logs_pri\">{{#t}}Console logs{{\/t}}<\/label>\n\t\t<select multiple=\"multiple\" id=\"client_logs_pri\" size=\"30\" data-inline-saver=\"#prefs_debug\" class=\"bottom_margin\">\n\t\t\t<option value=\"all\"{{#if client_logs_pri_all_selected}} selected{{\/if}}>{{#t}}All{{\/t}}<\/option>\n\t\t\t{{#each whitelisted_pris}}\n\t\t\t\t<option value=\"{{this.numbers}}\"{{#if this.selected}} selected{{\/if}}>{{#if this.name}}{{this.name}}{{else}}{{this.numbers}}{{\/if}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/select>\n\t\t<span class=\"normal tiny_top_margin block greigh\">{{#t}}Enabling console logs can help Slack engineers and customer experience agents track down issues you are experiencing.{{\/t}}<\/span>\n\t<\/p>\n{{\/if}}\n<p class=\"bold\">{{#t}}Changing the following preferences will reload Slack.{{\/t}}<\/p>\n<p>\n\t<label class=\"checkbox bottom_margin\">\n\t\t<input id=\"ls_disabled_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_debug\">\n\t\t{{#t}}\n\t\tDisable Local Storage<br>\n\t\t<span class=\"normal\">This will disable Slack from storing data on your computer, and can be used to debug lagginess in the Slack UI.<\/span>\n\t\t{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox bottom_margin\">\n\t\t<input id=\"ss_emojis_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_debug\">\n\t\t{{#t}}\n\t\tDisable Emoji Spritesheets<br>\n\t\t<span class=\"normal\">This will make loading emoji slower, but it might help if you are experiencing slowness in the Slack UI.<\/span>\n\t\t{{\/t}}\n\t<\/label>\n\t<label class=\"checkbox bottom_margin\">\n\t\t<input id=\"enhanced_debugging_cb\" type=\"checkbox\" data-inline-saver=\"#prefs_debug\">\n\t\t{{#t}}\n\t\tEnable Performance Logging<br>\n\t\t<span class=\"normal\">This will help our engineers track down performance issues with Slack.<\/span>\n\t\t{{\/t}}\n\t<\/label>\n\t{{#feature flag=\"feature_tinyspeck\"}}\n\t\t{{#feature flag=\"feature_thin_channel_membership\"}}\n\t\t\t<label class=\"checkbox bottom_margin\">\n\t\t\t\t<input id=\"thin_channel_membership\" checked=\"\" type=\"checkbox\" data-inline-saver=\"#prefs_debug\">\n\t\t\t\t{{#t}}Lazily load channel membership<br>\n\t\t\t\t<span class=\"normal\">Don't fetch full channel membership lists. (Still in development)<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t{{\/feature}}\n\t\t{{#feature flag=\"feature_flannel_fe\"}}\n\t\t\t<label class=\"select bottom_margin no_left_margin half_width\">\n\t\t\t\t{{#t}}Flannel server pool{{\/t}}<br>\n\t\t\t\t<select id=\"flannel_server_pool\" data-inline-saver=\"#prefs_debug\">\n\t\t\t\t\t<option value=\"production\">{{#t}}Production{{\/t}}<\/option>\n\t\t\t\t\t<option value=\"canary\">{{#t}}Canary{{\/t}}<\/option>\n\t\t\t\t\t<option value=\"random\">{{#t}}Production \/ canary at random{{\/t}}<\/option>\n\t\t\t\t<\/select>\n\t\t\t<\/label>\n\t\t{{\/feature}}\n\t{{\/feature}}\n<\/p>\n";
