TS.raw_templates['file_sharing_channel_row'] = "{{i18n_ns 'file_share'}}\n\n{{#if item.is_group}}\n\t{{#if item.is_mpim}}\n\t\t{{#if show_share_prefix}}<span class=\"share_prefix\">{{#t}}Share in:{{\/t}} <\/span>{{\/if}}<i class=\"ts_icon multipary_dm_icon ts_icon_multiparty_dm_{{mpimMemberCount item}}\"><\/i>{{mpimDisplayName item}}\n\t{{else}}\n\t\t{{#if show_share_prefix}}<span class=\"share_prefix\">{{#t}}Share in:{{\/t}} <\/span>{{\/if}}<i class=\"ts_icon ts_icon_lock\"><\/i>{{item.name}} {{#if item.is_shared}}{{> shared_channel_icon}}{{\/if}}\n\t{{\/if}}\n{{else}}\n\t{{#if item.is_channel}}\n\t\t{{#if show_share_prefix}}<span class=\"share_prefix\">{{#t}}Share in:{{\/t}} <\/span>{{\/if}}<i class=\"ts_icon ts_icon_channel\"><\/i>{{item.name}} {{#if item.is_shared}}{{> shared_channel_icon}}{{\/if}}\n\t{{else}}\n\t\t{{#if show_share_prefix}}<span class=\"share_prefix\">{{#t}}Share with:{{\/t}} <\/span>{{\/if}}{{makeMemberPresenceIcon item}}{{#feature flag=\"feature_name_tagging_client\"}}{{getMemberFullName item}}{{#if item.is_self}} {{#t}}(you){{\/t}} {{\/if}}{{#if item.profile.preferred_name}}<span class=\"preferred_name\">{{getMemberPreferredName item}}<\/span>{{\/if}}{{else}}{{getMemberDisplayName item}}{{#if item.is_self}} {{#t}}(you){{\/t}}{{\/if}}{{\/feature}}\n\t{{\/if}}\n{{\/if}}\n";
