TS.raw_templates['billing_contact'] = "\t{{i18n_ns \"pages_admin\"}}\n\t{{!-- hbslint-disable syntax --}}\n\t{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\t<div class=\"billing_contact {{#if member.is_primary_owner}}primary_owner{{\/if}} {{#if member.deleted}}inactive{{\/if}}\" data-contact-id=\"{{contact.id}}\">\n\t\t{{#if member}}\n\t\t\t{{{makeMemberPreviewLinkImage member.id 48}}}\n\t\t\t<div class=\"inline_block\" style=\"margin-left: 8px\">\n\t\t\t\t<div class=\"no_wrap\">\n\t\t\t\t\t<strong>{{#if member.is_self}}{{#t note=\"Shown when primary owner is viewing primary owner field\"}}You &bull;{{\/t}} {{\/if}}{{#feature flag=\"feature_name_tagging_client\"}}{{getMemberFullName member}}{{else}}{{getMemberDisplayName member}}{{\/feature}}<\/strong>\n\t\t\t\t\t{{#if member.deleted}}&bull; <em class=\"subtle_silver\">{{#t note=\"Display next to username if user is disabled\"}}(Disabled){{\/t}}<\/em>{{\/if}}\n\t\t\t\t<\/div>\n\t\t\t\t<div>{{member_type}} {{#unless member.is_primary_owner}}&bull; {{member.profile.email}}{{\/unless}}<\/div>\n\t\t\t<\/div>\n\t\t\t{{#if is_primary_and_self}}\n\t\t\t\t<label class=\"checkbox primary_owner_toggle_label\" for=\"primary_owner_toggle\">\n\t\t\t\t\t<input id=\"primary_owner_toggle\" type=\"checkbox\"> {{#t}}Send billing emails to you at <strong>{member.profile.email}<\/strong>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t<div class=\"inline_block\" style=\"margin-left: 56px\">\n\t\t\t\t<div class=\"no_wrap\"><strong>{{contact.email}}<\/strong><\/div>\n\t\t\t\t<div>{{#t note=\"header to display billing contact information\"}}Billing Contact{{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t\t{{#unless member.is_primary_owner}}\n\t\t\t<a class=\"remove_contact\"><i class=\"ts_icon ts_icon_times float_right\"><\/i><\/a>\n\t\t{{\/unless}}\n\t<\/div>\n";
TS.raw_templates['billing_add_contact_form'] = "\t{{i18n_ns \"pages_admin\"}}\n\t<div id=\"add_contact_form\" class=\"top_margin\">\n\t\t<div>\n\t\t\t<div>{{#t}}Add a billing contact from your team:{{\/t}}<\/div>\n\t\t\t<div class=\"add_contact_input\">\n\t\t\t\t<select id=\"user_contact_select\" multiple data-placeholder=\"{{#t}}Type the new billing contact's name{{\/t}}\">\n\t\t\t\t\t{{#each members}}\n\t\t\t\t\t\t<option value=\"{{id}}\">{{#feature flag=\"feature_name_tagging_client\"}}{{getMemberFullName this}} ({{profile.email}}){{else}}{{#if real_name}}{{real_name}} &bull;{{\/if}} {{name}}{{\/feature}}<\/option>\n\t\t\t\t\t{{\/each}}\n\t\t\t\t<\/select>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t<div class=\"small_top_margin\">\n\t\t\t<div>{{#t}}Or by email address:{{\/t}}<\/div>\n\t\t\t<input id=\"email_contact_input\" class=\"add_contact_input small no_bottom_margin\" type=\"text\" placeholder=\"{{#t note=\"example email for billing contact\"}}name@example.com{{\/t}}\">\n\t\t<\/div>\n\n\t\t<button class=\"btn ladda-button top_margin\" data-style=\"expand-right\"><span class=\"ladda-label\">{{#t}}Add billing contact{{\/t}}<\/span><\/button>\n\t<\/div>\n";
TS.raw_templates['billing_history_list'] = "{{i18n_ns \"billing_history_list\"}}\n{{#if_gt history.length compare=0}}\n\t<table class=\"full_width\">\n\t\t<tr>\n\t\t\t<th class=\"billing_list_cell cell_date hide_on_mobile\">{{#t}}Date{{\/t}}<\/th>\n\t\t\t<th>{{#t}}Item{{\/t}}<\/th>\n\t\t\t<th class=\"billing_list_cell cell_charges\">{{#t note=\"column title of billing history table: total charge for billing item\"}}Charges{{\/t}}<\/th>\n\t\t\t<th class=\"billing_list_cell cell_credit_balance\">{{#t note=\"column title of billing history table: credit balance remaining\"}}Credit<br>Balance{{\/t}}<\/th>\n\t\t<\/tr>\n\t\t{{#each history}}\n\t\t<tr data-qa=\"{{this.id}}\" >\n\t\t\t{{#if_equal this.type compare=\"monthly_statement\"}}\n\t\t\t\t<td data-qa=\"billing_item_date\" class=\" billing_list_cell cell_date hide_on_mobile\">\n\t\t\t\t\t{{#if this.has_billing_statement}}\n\t\t\t\t\t\t<a data-qa=\"billing_item_link\" href=\"\/admin\/billing\/{{this.id}}\">{{#t note=\"convert to MMMM y format (ex: January 2017)\" month_year=(toMonthYearFormat this.month_start)}}{month_year}{{\/t}}<\/a>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t  note=\"convert to MMMM y format (ex: January 2017)\" month_year=(toMonthYearFormat this.month_start)}}{month_year}{{\/t}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t<\/td>\n\t\t\t{{else}}\n\t\t\t\t<td data-qa=\"billing_item_date\" class=\" billing_list_cell cell_date hide_on_mobile\">\n\t\t\t\t\t{{#if this.has_billing_statement}}\n\t\t\t\t\t\t<a data-qa=\"billing_item_link\" href=\"\/admin\/billing\/{{this.id}}\">{{#t date_create=(convertTimestampToMilliseconds this.date_create)}}{date_create, date, short}{{\/t}}<\/a>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t date_create=(convertTimestampToMilliseconds this.date_create)}}{date_create, date, short}{{\/t}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t<\/td>\n\t\t\t{{\/if_equal}}\n\t\t\t<td data-qa=\"billing_item_description\" class=\"billing_list_cell\">\n\t\t\t\t{{> billing_history_list_item_cell this}}\n\t\t\t<\/td>\n\t\t\t<td data-qa=\"billing_item_charges\" class=\"billing_list_cell cell_charges\">\n\t\t\t\t{{> billing_history_list_charges_cell this}}\n\t\t\t<\/td>\n\t\t\t<td data-qa=\"billing_item_credit\" class=\"billing_list_cell cell_credit_balance\">\n\t\t\t\t{{> billing_history_list_balance_cell this}}\n\t\t\t<\/td>\n\t\t<\/tr>\n\t\t{{\/each}}\n\t<\/table>\n{{else}}\n\t<p class=\"subtle_silver align_center large_top_padding col span_1_of_2 margin_auto float_none\">{{#t}}You have no billing history for this month.{{\/t}}<\/p>\n{{\/if_gt}}\n";
TS.raw_templates['billing_history_list_item_cell'] = "{{i18n_ns \"billing_history_list\"}}\n{{#if is_event}}\n\t{{event_desc}}\n{{else if is_billing}}\n\t{{#unless is_monthly_statement}}\n\t<div class=\"show_on_mobile bold\">\n\t\t{{#if has_billing_statement}}\n\t\t\t<a href=\"\/admin\/billing\/{{id}}\">\n\t\t\t\t{{formatted_date}}\n\t\t\t<\/a>\n\t\t{{else}}\n\t\t\t{{formatted_date}}\n\t\t{{\/if}}\n\t<\/div>\n\t{{\/unless}}\n\t{{#if has_billing_statement}}\n\t\t<a data-qa=\"link_billing_statement\" href=\"\/admin\/billing\/{{id}}\" class=\"link_billing_statement indifferent_grey\">\n\t\t\t<span>{{> billing_history_item_strings this}}<\/span>\n\t\t<\/a>\n\t{{else}}\n\t\t<span>{{> billing_history_item_strings this}}<\/span>\n\t{{\/if}}\n\t{{#if has_billing_statement}}\n\t\t<span>(<a href=\"\/admin\/billing\/{{id}}\/pdf\">{{#t note=\"download PDF button label\"}}PDF{{\/t}}<\/a>)<\/span>\n\t{{\/if}}\n{{else}}\n\t<span>{{> billing_history_item_strings this}}<\/span>\n{{\/if}}\n<br \/>\n{{#if_equal type compare=\"invoice\"}}\n\t<span class=\"link_invoice_id\">{{#t}}Invoice #{id}{{\/t}}<\/span>\n{{\/if_equal}}\n{{#if has_billing_statement}}\n\t<span><a data-qa=\"link_statement_id\" href=\"\/admin\/billing\/{{id}}\" class=\"link_statement_id\">{{#t}}Billing Statement #{id}{{\/t}}<\/a><\/span>\n{{\/if}}";
TS.raw_templates['billing_history_item_strings'] = "{{i18n_ns \"billing_history_list\"}}\n{{!--\nBilling item type to string partial\nUsed in billing_history_list_item_col.hbs\n--}}\n\n{{!-- types that have a billing statement associated --}}\n{{#if_equal type compare=\"monthly_statement\"}}\n\t<a href=\"\/admin\/billing\/{{this.id}}\" class=\"link_billing_statement\">\n\t{{#t}}\n\t\tMonthly Statement\n\t\t<span class=\"show_on_mobile inline\"> \u2013 {this.formatted_date}<\/span>\n\t{{\/t}}\n\t<\/a>\n{{else if payments_event_description}}\n\t{{payments_event_description}}\n{{else if_equal type compare=\"invoice_switch\"}}\n\t{{#t}}Switched to invoice{{\/t}}\n{{else if_equal type compare=\"invoice\"}}\n\t{{#t}}Invoice{{\/t}}\n{{else if_equal type compare=\"invoice_adjust\"}}\n\t{{#t}}Invoice adjusted{{\/t}}\n{{else if_equal type compare=\"invoice_cancel\"}}\n\t{{#t}}Your team is no longer paying by invoice.{{\/t}}\n{{else if_equal type compare=\"purchase\"}}\n\t{{#if_equal is_discounted compare=true}}\n\t\t{{#if_equal is_simple_discount compare=true}}\n\t\t\t{{#if_equal product.termly compare=\"yearly\"}}\n\t\t\t\t{{#t}}Purchased the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted {discount_plan.0.percentage}%)<\/span>, paying Annually{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Purchased the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted {discount_plan.0.percentage}%)<\/span>, paying Monthly{{\/t}}\n\t\t\t{{\/if_equal}}\n\n\t\t{{else}}\n\t\t\t{{#if_equal this.product.termly compare=\"yearly\"}}\n\t\t\t\t{{#t}}Purchased the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted)<\/span>, paying Annually{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Purchased the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted)<\/span>, paying Monthly{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t{{\/if_equal}}\n\t{{else}}\n\t\t{{#if_equal product.termly compare=\"yearly\"}}\n\t\t\t{{#t}}Purchased the <strong>{formatted_product_level} plan<\/strong>, paying Annually{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Purchased the <strong>{formatted_product_level} plan<\/strong>, paying Monthly{{\/t}}\n\t\t{{\/if_equal}}\n\t{{\/if_equal}}\n{{else if_equal type compare=\"renewal\"}}\n\t{{#if_equal is_discounted compare=true}}\n\t\t{{#if_equal is_simple_discount compare=true}}\n\t\t\t{{#if_equal product.termly compare=\"yearly\"}}\n\t\t\t\t{{#t}}Renewed the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted {discount_plan.0.percentage}%)<\/span>, paying Annually{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Renewed the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted {discount_plan.0.percentage}%)<\/span>, paying Monthly{{\/t}}\n\t\t\t{{\/if_equal}}\n\n\t\t{{else}}\n\t\t\t{{#if_equal this.product.termly compare=\"yearly\"}}\n\t\t\t\t{{#t}}Renewed the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted)<\/span>, paying Annually{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Renewed the <strong>{formatted_product_level} plan<\/strong><span class=\"inline_discount\"> (Discounted)<\/span>, paying Monthly{{\/t}}\n\t\t\t{{\/if_equal}}\n\t\t{{\/if_equal}}\n\t{{else}}\n\t\t{{#if_equal this.product.termly compare=\"yearly\"}}\n\t\t\t{{#t}}Renewed the <strong>{formatted_product_level} plan<\/strong>, paying Annually{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Renewed the <strong>{formatted_product_level} plan<\/strong>, paying Monthly{{\/t}}\n\t\t{{\/if_equal}}\n\t{{\/if_equal}}\n{{else if_equal type compare=\"cancel\"}}\n\t{{#t}}Switched to the <strong>Free plan<\/strong>{{\/t}}\n{{else if_equal type compare=\"switch\"}}\n\t{{#if_equal product.termly compare=\"yearly\"}}\n\t\t{{#t}}Switched to the <strong>{formatted_product_level} plan<\/strong>, paying Annually{{\/t}}\n\t{{else}}\n\t\t{{#t}}Switched to the <strong>{formatted_product_level} plan<\/strong>, paying Monthly{{\/t}}\n\t{{\/if_equal}}\n{{else if_equal type compare=\"future_cancel\"}}\n\t{{#t}}Switch to the <strong>Free plan<\/strong> at renewal time{{\/t}}\n{{else if_equal type compare=\"future_switch\"}}\n\t{{#if_equal product.termly compare=\"yearly\"}}\n\t\t{{#t}}Switch to the <strong>{formatted_product_level} plan<\/strong> at renewal time, paying Annually{{\/t}}\n\t{{else}}\n\t\t{{#t}}Switch to the <strong>{formatted_product_level} plan<\/strong> at renewal time, paying Monthly{{\/t}}\n\t{{\/if_equal}}\n{{else if_equal type compare=\"users_change\"}}\n\t{{#t}}Switched from <strong>{num_users_from} to {num_users_to}<\/strong> {num_users_to, plural, =1 {user} other {users}}{{\/t}}\n{{else if_equal type compare=\"late\"}}\n\t{{#t}}Paid money owed{{\/t}}\n{{else if_equal type compare=\"expire\"}}\n\t{{#t}}Paid plan expired{{\/t}}\n{{else if_equal type compare=\"comp_gift\"}}\n\t{{#t}}Given the <strong>{formatted_product_level} plan<\/strong>{{\/t}}\n{{else if_equal type compare=\"trial_start\"}}\n\t{{#t}}Started a free trial{{\/t}}\n{{else if_equal type compare=\"charge_high_balance\"}}\n\t{{#t}}Charged for high balance{{\/t}}\n{{else if_equal type compare=\"annual_team_balance_paid\"}}\n\t{{#t}}Monthly accrued balance for annual teams{{\/t}}\n{{!-- Types with no billing statment associated, will not link --}}\n{{else if_equal type compare=\"staff_gift\"}}\n\t{{#if_equal this.details.gift_type compare=\"surprise\"}}\n\t\t{{#if_gt this.delta compare=0}}\n\t\t\t{{#t}}Gift from Slack{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Credit Adjustment{{\/t}}\n\t\t{{\/if_gt}}\n\t{{else if_gt this.delta compare=0}}\n\t\t{{#t}}Account Credit{{\/t}}\n\t{{else}}\n\t\t{{#t}}Credit Adustment{{\/t}}\n\t{{\/if_equal}}\n{{else if_equal type compare=\"referral_purchase_credit\"}}\n\t{{#t}}Credit for referring a new team{{\/t}}\n{{else if_equal type compare=\"referral_credit\"}}\n\t{{#t}}Referral signup credit{{\/t}}\n{{else if_equal type compare=\"beta_credit\"}}\n\t{{#t}}Beta testing credit{{\/t}}\n{{else if_equal type compare=\"launch_credit\"}}\n\t{{#t}}New team credit{{\/t}}\n{{else if_equal type compare=\"credit_test_group\"}}\n\t{{#t}}New team credit{{\/t}}\n{{else if_equal type compare=\"survey_credit\"}}\n\t{{#t}}Survey completed{{\/t}}\n{{else if_equal type compare=\"txn_void\"}}\n\t{{#t}}Voided Payment{{\/t}}\n{{else if_equal type compare=\"txn_refund\"}}\n\t{{#t}}Refunded Payment{{\/t}}\n{{else if_equal type compare=\"sales_tax_refund\"}}\n\t{{#t}}Sales Tax Refund{{\/t}}\n{{else if_equal type compare=\"enterprise_transfer\"}}\n\t{{#if enterprise_transfer.enterprise_id}}\n\t\t{{#t}}Transferred to <a href=\"{enterprise_transfer.enterprise_url}\">{enterprise_transfer.enterprise_name}<\/a>{{\/t}}\n\t{{else if enterprise_transfer.team_id}}\n\t\t{{#t}}Transferred to <a href=\"{enterprise_transfer.team_url}\">{enterprise_transfer.team_name}<\/a>{{\/t}}\n\t{{else}}\n\t\t{{#t}}Enterprise plan transfer{{\/t}}\n\t{{\/if}}\n{{else if_equal type compare=\"event_billing_linked_to_enterprise\"}}\n\t{{#t}}Team linked to Enterprise{{\/t}}\n{{else if_equal type compare=\"transfer\"}}\n\t{{#if_gt delta compare=0}}\n\t\t{{#t}}Transferred {formatted_charges.delta} to team{{\/t}}\n\t{{else}}\n\t\t{{#t}}Transferred {formatted_charges.delta} from team{{\/t}}\n\t{{\/if_gt}}\n\t{{#if_equal details.reason compare='payments_group'}}\n\t\t{{#t}}(payment group transfer){{\/t}}\n\t{{\/if_equal}}\n\t{{#if_equal details.reason compare='enterprise'}}\n\t\t{{#t}}(enterprise plan transfer){{\/t}}\n\t{{\/if_equal}}\n{{\/if_equal}}\n\n";
TS.raw_templates['billing_history_list_charges_cell'] = "{{i18n_ns \"billing_history_list\"}}\n{{!-- billing items --}}\n{{!-- item is a refund --}}\n{{#if_equal charge_type compare=\"is_refund\"}}\n\t<span class=\"inline_positive\">{{#t note=\"label if refund or credits are added to an account\"}}Credited <strong>{formatted_charges.refund}{{\/t}}<\/strong><\/span><br \/>\n{{\/if_equal}}\n{{!-- Item is some kind of card charge --}}\n{{#if_equal charge_type compare=\"is_failed_charge\"}}\n\t<span class=\"inline_negative\">{{#t note=\"label if credit card charge fails\"}}Failed to charge <strong>{formatted_charges.card_charge}{{\/t}}<\/strong><\/span>\n{{\/if_equal}}\n{{#if_equal charge_type compare=\"is_voided_or_refunded\"}}\n\t<s class=\"inline_negative\">{{#t note=\"label for credit card charge\"}}Charged <strong>{formatted_charges.card_charge}{{\/t}}<\/strong><\/s>\n{{\/if_equal}}\n{{#if_equal charge_type compare=\"is_charge\"}}\n\t{{#t note=\"label for credit card charge\"}}Charged <strong>{formatted_charges.card_charge}{{\/t}}<\/strong>\n{{\/if_equal}}\n{{!-- Item is an invoice or invoice adjustment--}}\n{{#if_equal charge_type compare=\"is_paid_invoice\"}}\n\t{{#if_gt invoice.amount compare=0}}\n\t\t{{#if invoice.amount_adjusted}}\n\t\t\t{{#t note=\"label for invoice amount paid\"}}Paid:{formatted_invoice.amount_adjusted}{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t note=\"label for invoice amount paid\"}}Paid:{formatted_invoice.amount_net}{{\/t}}\n\t\t{{\/if}}\n\t{{\/if_gt}}\n{{\/if_equal}}\n{{#if_equal charge_type compare=\"is_unpaid_invoice\"}}\n\t{{#if_gt amount compare=0}}\n\t\t<strong>\n\t\t{{#if amount_adjusted}}\n\t\t\t{{#t note=\"label for invoice amount unpaid\"}}Unpaid:{formatted_invoice.amount_adjusted}{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t note=\"label for invoice amount unpaid\"}}Unpaid:{formatted_invoice.amount_net}{{\/t}}\n\t\t{{\/if}}\n\t\t<\/strong>\n\t{{\/if_gt}}\n{{\/if_equal}}\n{{!-- item is free credits from a trial start --}}\n{{#if_equal charge_type compare=\"is_free_credits_from_trial_start\"}}\n\t<span class=\"inline_positive\">{{#t note=\"label for credits from a free trial\"}}Credited <strong>{formatted_charges.free_credits}{{\/t}}<\/strong><\/span>\n{{\/if_equal}}\n{{#if_equal charge_type compare=\"is_user_change_debit\"}}\n\t{{#t note=\"label when a users balance is debited\"}}Debited balance by <strong>{formatted_charges.total_charge}{{\/t}}<\/strong>\n{{\/if_equal}}\n{{!-- not billing items --}}\n{{#if_equal charge_type compare=\"is_credited\"}}\n\t<span class=\"inline_positive\">{{#t note=\"label if a user's account is credited\"}}Credited <strong>{formatted_charges.delta}{{\/t}}<\/strong><\/span><br \/>\n{{\/if_equal}}\n{{#if_equal charge_type compare=\"is_removed_credits\"}}\n\t{{#if credits_charge}}\n\t\t{{#t note=\"label is credits are removed\"}}Removed <strong>{formatted_charges.credits_charge}<\/strong> credits{{\/t}}<br \/>\n\t{{else}}\n\t\t{{!-- credit adjustment --}}\n\t\t{{#t note=\"label is credits are removed\"}}Removed <strong>{formatted_charges.delta}<\/strong> credits{{\/t}}<br \/>\n\t{{\/if}}\n{{\/if_equal}}";
