TS.raw_templates['create_email_view'] = "{{i18n_ns \"team_creation\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_left\">\n\t{{> create_inc_find_team_mobile}}\n\n\t<form class=\"fs_split_flex_wrapper\" onsubmit=\"return false;\">\n\t\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\t\t\n\t\t{{> create_inc_rate_limit}}\n\t\t{{> create_inc_api_alert}}\n\n\t\t<div id=\"email_form_body\" class=\"fs_split_body\">\n\t\t\t<h1>{{#t}}Create a new team{{\/t}}<\/h1>\n\t\t\t\t<label id=\"email_label\"><span class=\"normal\">{{#t}}Your <\/span>email address{{\/t}}<\/label>\n\t\t\t\t<input type=\"text\" placeholder=\"{{#t}}you@example.com{{\/t}}\" id=\"signup_email\" data-qa=\"email_field\" spellcheck=\"false\" {{#if email}} value=\"{{email}}\" {{\/if}} aria-labelledby=\"email_label\" data-email-healing=\"true\"\/>\n\t\t\t\t<p class=\"error_message\"><\/p>\n\t\t\t\t{{#if referral}}\n\t\t\t\t\t<h4>{{#t}}Sign up now and get $100.00 in free credit thanks to the team at {referral}!{{\/t}}<\/h4>\n\t\t\t\t{{\/if}}\n\t\t<\/div>\n\n\t\t<div id=\"submit\" class=\"fs_split_footer\">\n\t\t\t{{> create_inc_email_misc this}}\n\n\t\t\t<div class=\"button_container\">\n\t\t\t\t<button id=\"submit_btn\" class=\"btn btn_large ladda-button\" {{#unless email}}disabled=\"true\" aria-disabled=\"true\"{{\/unless}} data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t\t<span class=\"ladda-label\">{{#t}}Next{{\/t}}{{> ts_icon class=\"ts_icon_arrow_right\"}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t{{> create_inc_legalese_mobile}}\n\n\t<\/form>\n<\/div>\n\n{{> create_inc_graphics_pane inc_legalese=1 inc_find_team=1}}";
TS.raw_templates['create_confirm_email_view'] = "{{i18n_ns \"team_creation\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_full_width\">\n\n\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n\t<form class=\"fs_split_flex_wrapper\" onsubmit=\"return false;\">\n\n\t\t<div id=\"confirm_email_form_body\" class=\"fs_split_body\">\n\t\t\t<h1>{{#t note=\"This page tells the user to check their email inbox for a confirmation code we just sent them.\"}}Check your email!{{\/t}}<\/h1>\n\t\t\t<p class=\"desc\">{{#t}}We\u2019ve sent a six-digit confirmation code to <strong>{email}<\/strong>. Enter it below to confirm your email&nbsp;address.{{\/t}}<\/p>\n\n\t\t\t<label><span class=\"normal\">{{#t}}Your <\/span>confirmation code{{\/t}}<\/label>\n\t\t\t<div class=\"confirmation_code split_input large_bottom_margin\" data-multi-input-code=\"true\">\n\t\t\t\t<div class=\"confirmation_code_group\">\n\t\t\t\t{{#repeat 3}}\n\t\t\t\t\t<div class=\"split_input_item input_wrapper\"><input type=\"text\" class=\"inline_input\" maxlength=\"1\"\/>{{n}}<\/div>\n\t\t\t\t{{\/repeat}}\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"confirmation_code_span_cell\">&mdash;<\/div>\n\n\t\t\t\t<div class=\"confirmation_code_group\">\n\t\t\t\t{{#repeat 3}}\n\t\t\t\t\t<div class=\"split_input_item input_wrapper\"><input type=\"text\" class=\"inline_input\" maxlength=\"1\"\/>{{n}}<\/div>\n\t\t\t\t{{\/repeat}}\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"confirmation_code_checker\" data-state=\"unchecked\">\n\t\t\t\t<div class=\"confirmation_code_state_message unchecked subtle_silver\">\n\t\t\t\t\t<p>{{#t}}Be sure to keep this window open while you check for your code.{{\/t}}<\/p>\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"confirmation_code_state_message processing\">\n\t\t\t\t\t<svg class=\"confirmation_code_spinner ts_icon ts_icon_spin ts_icon_spinner\">\n\t\t\t\t\t\t<use xlink:href=\"\/img\/starburst.svg#starburst_svg\"\/>\n\t\t\t\t\t<\/svg>\n\t\t\t\t\t<p>{{#t}}Checking your code...{{\/t}}<\/p>\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"confirmation_code_state_message error\">\n\t\t\t\t\t<ts-icon class=\"ts_icon_exclamation_circle\"><\/ts-icon>\n\t\t\t\t\t<p class=\"mustard_yellow\">{{#t}}That code wasn't valid. Give it another go!{{\/t}}<\/p>\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"confirmation_code_state_message ratelimited\"><ts-icon class=\"ts_icon_exclamation_circle\"><\/ts-icon>\n\t\t\t\t\t<p class=\"mustard_yellow bold\">{{#t}}Whoa, you\u2019re going too fast!{{\/t}}<\/p>\n\t\t\t\t\t<p class=\"mustard_yellow\">{{#t}}Slow down a bit. You might have better luck if you try again in a minute.{{\/t}}<\/p>\n\t\t\t\t<\/div>\n\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t<div class=\"fs_split_footer\"><\/div>\n\t<\/form>\n<\/div>\n\n";
TS.raw_templates['create_domain_claiming_view'] = "{{i18n_ns \"create\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_full_width domain_claiming\">\n\n\t{{#if minimal_ui_theme}}\n\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\t{{\/if}}\n\n\t<div class=\"fs_split_flex_wrapper\">\n\t\t{{#unless minimal_ui_theme}}\n\t\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\t\t{{\/unless}}\n\n\t\t<div class=\"fs_split_body align_center\">\n\n\t\t\t<div class=\"bottom_margin\">\n\t\t\t\t<img class=\"member_image\" src=\"{{enterprise.icon.image_88}}\" srcset=\"{{enterprise.icon.image_88}} 1x, {{enterprise.icon.image_230}} 2x\" \/>\n\t\t\t<\/div>\n\n\t\t\t{{#if email_has_account}}\n\n\t\t\t\t<h3>{{#t}}Only Org Admins can create new {enterprise.name} workspaces.{{\/t}}<\/h3>\n\n\t\t\t\t{{#if is_logged_in}}\n\n\t\t\t\t\t<!-- signed-in version -->\n\n\t\t\t\t\t{{#if enterprise.org_contact_email}}\n\t\t\t\t\t\t<p>{{#t}}If you need help getting access to or creating a workspace, <a href=\"mailto:{enterprise.org_contact_email}\">contact an Org Admin<\/a>. Or, continue to access your workspaces.{{\/t}}<\/p>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<p>{{#t}}If you need help getting access to or creating a workspace, contact an Org Admin. Or, continue to access your workspaces.{{\/t}}<\/p>\n\t\t\t\t\t{{\/if}}\n\n\t\t\t\t\t<div class=\"large_top_margin\">\n\t\t\t\t\t\t{{!-- link to myteam.slack.com --}}\n\t\t\t\t\t\t<a href=\"{{next_action_href}}\" id=\"next_action\" type=\"button\" class=\"btn_large btn_info btn\">{{#t}}Continue to Slack{{\/t}}<\/a>\n\t\t\t\t\t<\/div>\n\n\t\t\t\t{{else}}\n\n\t\t\t\t\t<!-- signed-out version -->\n\n\t\t\t\t\t{{#if enterprise.org_contact_email}}\n\t\t\t\t\t\t<p>{{#t}}If you need help getting access to or creating a workspace, <a href=\"mailto:{enterprise.org_contact_email}\">contact an Org Admin<\/a>. Or, sign in to access your workspaces.{{\/t}}<\/p>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<p>{{#t}}If you need help getting access to or creating a workspace, contact an Org Admin. Or, sign in to access your workspaces.{{\/t}}<\/p>\n\t\t\t\t\t{{\/if}}\n\n\t\t\t\t\t<div class=\"medium_top_margin medium_bottom_margin\">\n\t\t\t\t\t\t{{!-- button will be updated to include \"with [okta]\" or likewise based on auth.sso response --}}\n\t\t\t\t\t\t<a href=\"{{next_action_href}}\" id=\"next_action\" type=\"button\" class=\"btn_large btn_info btn\">{{#t}}Sign in{{\/t}}<\/a>\n\t\t\t\t\t<\/div>\n\n\t\t\t\t{{\/if}}\n\n\t\t\t{{else}}\n\n\t\t\t\t<!-- user has not yet created an account -->\n\n\t\t\t\t<h3>{{#t}}{enterprise.name} is already using Slack{{\/t}}<\/h3>\n\n\t\t\t\t<p>\n\t\t\t\t\t{{#t}}Sign in with SSO to create your account.{{\/t}}\n\t\t\t\t<\/p>\n\n\t\t\t\t<div class=\"large_top_margin medium_bottom_margin\">\n\t\t\t\t\t<a href=\"{{next_action_href}}\" id=\"next_action\" type=\"button\" class=\"btn_large btn_info btn\">{{#t}}Sign in{{\/t}}<\/a>\n\t\t\t\t<\/div>\n\n\t\t\t\t<hr \/>\n\n\t\t\t\t<p class=\"small\">\n\t\t\t\t\t{{#if enterprise.org_contact_email}}\n\t\t\t\t\t\t{{#t}}Your organization has restricted the creation of workspaces by accounts using <strong>@{email_domain}<\/strong> email addresses. If you need help getting access or creating a workspace, <a href=\"mailto:{enterprise.org_contact_email}\">contact an organization administrator<\/a>.{{\/t}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t}}Your organization has restricted the creation of workspaces by accounts using <strong>@{email_domain}<\/strong> email addresses. If you need help getting access or creating a workspace, contact an organization administrator.{{\/t}}\n\t\t\t\t\t{{\/if}}\n\t\t\t\t<\/p>\n\n\t\t\t{{\/if}}\n\n\t\t<\/div>\n\t\t<div class=\"fs_split_footer\"><\/div>\n\t<\/div>\n\n<\/div>\n\n";
TS.raw_templates['create_team_name_view'] = "{{i18n_ns \"team_creation\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_full_width\">\n\n\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n\t<form class=\"fs_split_flex_wrapper\" onsubmit=\"return false;\">\n\n\t\t<div id=\"team_name_form_body\" class=\"fs_split_body\">\n\n\t\t\t<h1>{{#if header_copy}} {{preventWidow header_copy}} {{else}} {{#t}}What do you want to call your Slack team?{{\/t}} {{\/if}}<\/h1>\n\t\t\t{{#unless header_copy}}\n\t\t\t<p class=\"desc\">\n\t\t\t\t{{#t}}Name your team after the group that will be using Slack together.{{\/t}}\n\t\t\t<\/p>\n\t\t\t<p class=\"desc\">\n\t\t\t\t<span class=\"bold flat_grey\">{{#t}}Work at a large company?<\/span> Try using the name of your division, instead of your company name.{{\/t}}\n\t\t\t<\/p>\n\t\t\t{{\/unless}}\n\t\t\t<label id=\"teamname_label\">\n\t\t\t\t{{#if input_label}} {{input_label}} {{else}} {{#t}}Slack team name <span class=\"subtle_silver normal\">(you can change this later)<\/span>{{\/t}} {{\/if}}\n\t\t\t<\/label>\n\t\t\t<input type=\"text\" placeholder=\"{{#if placeholder}}{{placeholder}}{{else}}{{#t}}Ex. Acme or Acme Marketing{{\/t}}{{\/if}}\" id=\"signup_team_name\" maxlength=\"255\" autocomplete=\"off\" data-qa=\"team_name_field\" value=\"{{team_name}}\" aria-labelledby=\"teamname_label\"\/>\n\t\t\t<p class=\"error_message\"><\/p>\n\t\t\t{{#if input_label}}<p class=\"subtle_silver normal\">{{#t}}We\u2019ll use this to name your Slack team, which you can always change later.{{\/t}}<\/p>{{\/if}}\n\t\t<\/div>\n\n\n\t\t<div id=\"submit\" class=\"fs_split_footer\">\n\t\t\t<div class=\"button_container\">\n\t\t\t\t<button id=\"submit_btn\" class=\"btn btn_large ladda-button\" {{#unless team_name}}disabled=\"true\" aria-disabled=\"true\"{{\/unless}} data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t\t<span class=\"ladda-label\">{{continue_btn_copy}}{{> ts_icon class=\"ts_icon_arrow_right\"}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/form>\n<\/div>\n";
TS.raw_templates['create_url_view'] = "{{i18n_ns \"team_creation\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_full_width\">\n\n\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n\t<form class=\"fs_split_flex_wrapper\" onsubmit=\"return false;\">\n\n\t\t{{> create_inc_rate_limit}}\n\t\t{{> create_inc_api_alert}}\n\n\t\t<div id=\"url_form_body\" class=\"fs_split_body\">\n\t\t\t<h1>{{#t}}What web domain do you want for your Slack team?{{\/t}}<\/h1>\n\n\t\t\t<p class=\"desc\">{{#t}}Choose the address you\u2019ll use to sign in to Slack.{{\/t}}<p>\n\t\t\t<label id=\"teamurl_label\">{{#t}}Your team domain<span class=\"subtle_silver normal\"> (letters, numbers, and dashes only)<\/span>{{\/t}}<\/label>\n\t\t\t<div class=\"input_wrapper url\">\n\t\t\t\t<p class=\"hidden input_spinner\"><\/p>\n\t\t\t\t<p class=\"seafoam_green hidden input_checkmark\">\n\t\t\t\t\t{{> ts_icon class=\"ts_icon_check_large neutral_white_bg\" aria_label=\"Slack web address is available\"}}\n\t\t\t\t<\/p>\n\t\t\t\t<input type=\"text\" id=\"signup_url\" class=\"url_subdomain\" maxlength=\"21\" autocomplete=\"off\" data-qa=\"url_field\" value=\"{{url}}\" aria-labelledby=\"teamurl_label\"\/>\n\t\t\t\t<p class=\"url_domain_slack_dot_com bold\">.slack.com<\/p>\n\t\t\t<\/div>\n\t\t\t<p class=\"error_message\"><\/p>\n\n\t\t\t<div id=\"url_info\" class=\"small_top_margin\">\n\t\t\t\t<div id=\"available_url_message\" class=\"small_top_margin is_faded_out\" aria-hidden=\"true\" data-qa=\"available_url_message\">\n\t\t\t\t\t{{#t}}Good news! Your team name is <span class=\"strong seafoam_green\">available<\/span> as your domain on Slack. We\u2019ve pre-filled it for you, but feel free to change it.{{\/t}}\n\t\t\t\t<\/div>\n\n\t\t\t\t<div id=\"unavailable_url_message\" class=\"is_faded_out\" aria-hidden=\"true\">\n\t\t\t\t\t<span class=\"italic\">\n\t\t\t\t\t\t<span class=\"bold\">\n\t\t\t\t\t\t\t<span id=\"unavailable_url\"><\/span>.slack.com\n\t\t\t\t\t\t<\/span>\n\t\t\t\t\t\t{{#t note=\"This Slack URL is already taken\"}}is already taken, how about...{{\/t}}\n\t\t\t\t\t<\/span>\n\n\t\t\t\t\t<div id=\"url_suggestions\"><\/div>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\n\t\t<\/div>\n\n\n\t\t<div id=\"submit\" class=\"fs_split_footer\">\n\t\t\t<div class=\"button_container\">\n\t\t\t\t<button id=\"submit_btn\" class=\"btn btn_large ladda-button\" {{#unless url}}disabled=\"true\" aria-disabled=\"true\"{{\/unless}} data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t\t<span class=\"ladda-label\">{{continue_btn_copy}}{{> ts_icon class=\"ts_icon_arrow_right\"}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/form>\n<\/div>\n";
TS.raw_templates['create_name_view'] = "{{i18n_ns \"team_creation\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_full_width\">\n\n\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n\t<form class=\"fs_split_flex_wrapper\" onsubmit=\"return false;\">\n\n\t\t<div class=\"fs_split_body\">\n\n\t\t\t<h1>{{#t}}What\u2019s your name?{{\/t}}<\/h1>\n\t\t\t<p class=\"desc\">{{#t}}Your name will be displayed along with your messages in Slack.{{\/t}}<\/p>\n\t\t\t<div class=\"names no_top_padding bottom_padding\" id=\"name_fields\">\n\t\t\t\t<label>{{#t}}Your name{{\/t}}<\/label>\n\t\t\t\t<div class=\"col span_1_of_2 no_padding name_field\" id=\"first_name_wrapper\">\n\t\t\t\t\t<input type=\"text\" placeholder=\"first name\" id=\"signup_first_name\" maxlength=\"35\" autocomplete=\"off\" data-qa=\"first_name_field\" value=\"{{first_name}}\" aria-label=\"First name\"\/>\n\t\t\t\t\t<p class=\"error_message\"><\/p>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"col span_1_of_2 no_padding name_field\" id=\"last_name_wrapper\">\n\t\t\t\t\t<input type=\"text\" placeholder=\"last name\" id=\"signup_last_name\" maxlength=\"35\" autocomplete=\"off\" data-qa=\"last_name_field\" value=\"{{last_name}}\" aria-label=\"Last name\"\/>\n\t\t\t\t\t<p class=\"error_message\"><\/p>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t\t<div id=\"username_form_body\" class=\"clear_both\">\n\t\t\t\t<label id=\"username_label\">{{#t}}Username{{\/t}}<\/label>\n\t\t\t\t<div class=\"input_wrapper username\">\n\t\t\t\t\t<p id=\"username_overlay\" class=\"input_overlay\"><\/p>\n\t\t\t\t\t<input type=\"text\" id=\"signup_username\" maxlength=\"21\" autocomplete=\"off\" data-qa=\"username_field\" value=\"{{username}}\" aria-labelledby=\"username_label username_rule_label\"\/>\n\t\t\t\t<\/div>\n\t\t\t\t<p class=\"error_message\"><\/p>\n\t\t\t\t<p id=\"username_rule_label\" class=\"subtle_silver\">{{#t}}Usernames must be all lowercase, with no spaces. They can only contain letters, numbers, periods, hyphens, and underscores.{{\/t}}<\/p>\n\t\t\t<\/div>\n\n\t\t\t{{#if inc_misc_and_legalese}}\n\t\t\t<div class=\"minimal_ui_email_misc_checkbox\">\n\t\t\t\t<input type=\"checkbox\" id=\"email_misc\" data-qa=\"email_checkbox\" {{#if uncheck_email}}{{else}}checked{{\/if}}>\n\t\t\t\t<label for=\"email_misc\">{{#t}}It's ok to send me email about the Slack service.{{\/t}}<\/label>\n\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t<\/div>\n\n\n\t\t<div id=\"submit\" class=\"fs_split_footer\">\n\t\t\t<div class=\"button_container\">\n\t\t\t\t<button id=\"submit_btn\" class=\"btn btn_large ladda-button\" {{#unless username}}disabled=\"true\" aria-disabled=\"true\"{{\/unless}} data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t\t<span class=\"ladda-label\">{{continue_btn_copy}}{{> ts_icon class=\"ts_icon_arrow_right\"}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t{{#if inc_misc_and_legalese}}\n\t\t\t<div class=\"minimal_ui_legalese\">\n\t\t\t\t{{#t}}By proceeding to create your account and use Slack, you are agreeing to our <a class=\"bold\" href=\"\/terms-of-service\">Terms&nbsp;of&nbsp;Service<\/a> and <a href=\"\/privacy-policy\" class=\"bold\">Privacy Policy<\/a>. If you do not agree, you cannot use Slack.{{\/t}}\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t<\/form>\n<\/div>\n";
TS.raw_templates['create_password_view'] = "{{i18n_ns \"team_creation\"}}\n\n<div id=\"signup_wrapper\" class=\"fs_split_pane fs_split_pane_full_width\">\n\t{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=create_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n\t<form class=\"fs_split_flex_wrapper\" onsubmit=\"return false;\">\n\n\t\t{{> create_inc_rate_limit}}\n\n\t\t<div id=\"password_form_body\" class=\"fs_split_body\">\n\n\t\t\t<h1>{{#t}}Set your password{{\/t}}<\/h1>\n\n\t\t\t<p class=\"subtle_silver\">{{#t}}Choose a password for signing in to Slack.{{\/t}}<\/p>\n\n\t\t\t<label class=\"normal\" for=\"password\">{{#t}}Password{{\/t}}<\/label>\n\t\t\t<input type=\"password\" id=\"signup_password\" data-qa=\"password-field\" placeholder=\"{{#t}}Password{{\/t}}\" name=\"password\"\/>\n\n\t\t\t<p class=\"error_message\" id=\"password_error_message\"><\/p>\n\t\t\t<p class=\"subtle_silver\">{{#t}}Passwords must be at least 6 characters long, and can\u2019t be things like <i>password<\/i>, <i>123456<\/i> or <i>abcdef<\/i>.{{\/t}}<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"submit\" class=\"fs_split_footer\">\n\t\t\t<div class=\"button_container\">\n\t\t\t\t<button id=\"submit_btn\" class=\"btn btn_large ladda-button\" disabled=\"true\" aria-disabled=\"true\" data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t\t<span class=\"ladda-label\">{{continue_btn_copy}}{{> ts_icon class=\"ts_icon_arrow_right\"}}<\/span>\n\t\t\t\t<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t<\/form>\n<\/div>";
